INSERT INTO `comments` VALUES (2,'Miguel Vaello','miguel.vaellomartinez@gmail.com','Se ha hecho con paciencia, mucha paciencia.',NULL,20,'Event','2014-10-20 14:07:44','2014-10-20 14:07:44'),(3,'Rafael Medina','rafamedgar@gmail.com','Conforme','2',20,'Event','2014-10-20 17:30:15','2014-10-20 17:30:15'),(4,'Yago','yago.ftw@gmail.com','¿Has probado Telegram? El protocolo es abierto y el cliente [1] es mucho mas estable que el de Whatsapp. He hecho un bot [2] y son bastantes sencillos de programar. \r\n\r\n[1] https://github.com/vysheng/tg\r\n[2] https://github.com/yagop/telegram-bot\r\n',NULL,63,'Event','2014-10-26 20:45:50','2014-10-26 20:45:50'),(5,'Alberto','albertof417@gmail.com','Buena idea!, podemos incluirlo en la charla si finalmente sale. Voy a investigar como hacerlo, aunque supongo que será igual de sencillo.\r\n\r\nSaludos!','4',63,'Event','2014-10-31 17:09:51','2014-10-31 17:09:51'),(6,'david','dricoarroyo@gmail.com','Interesante charla taller a la que asistiré',NULL,56,'Event','2014-11-10 16:41:50','2014-11-10 16:41:50'),(6138,'Miguel','miguel.vaellomartinez@gmail.com','Mola ¿Lo de los hashtags era necesario? Me recuerda un poco a esto: https://www.youtube.com/watch?v=57dzaMaouXA\r\n\r\nxD',NULL,78,'Event','2015-03-18 22:34:10','2015-03-18 22:34:10'),(6139,'Yago','yagoperezs@gmail.com','Si, totalmente necesarios.\r\n\r\n#Nofilter',NULL,78,'Event','2015-03-20 10:05:54','2015-03-20 10:05:54'),(6140,'Miguel','miguel.vaellomartinez@gmail.com','https://www.gnu.org/software/make/manual/make.pdf',NULL,87,'Event','2015-03-26 11:13:21','2015-03-26 11:13:21'),(6141,'Adrián','assddo@gmail.com','Una aclaración. Puse taller en la descripción y charla en el título porque no me aclaraba. Si saliera entre las más votadas, ya sería cosa de el ponente ver como hacerlo.',NULL,89,'Event','2015-04-02 22:05:02','2015-04-02 22:05:02'),(6143,'pepe','pepe@pepe.com','Hola:\r\n\r\n¿Se van a grabar en vídeo las charlas y se van a colgar en algún sitio?\r\n\r\nGracias',NULL,90,'Event','2015-04-20 12:14:35','2015-04-20 12:14:35'),(6144,'Rafael','rafamedgar@gmail.com','Hola, la idea es grabar las charlas y colgarlas en el canal de YouTube del GULUC3M.','6143',90,'Event','2015-04-20 20:02:38','2015-04-20 20:02:38'),(6145,'viagra','smithb143@gmail.com','Hello!\n<a href=\"http://viagra4canada.com/\">viagra</a> , <a href=\"http://cialis4canada.com/\">cialis</a> , ','6140',87,'Event','2015-04-24 21:29:50','2015-04-24 21:29:50'),(6146,'mvaello','miguel.vaellomartinez@gmail.com','Me temo que Blender y Autocad no tiene el mismo objetivo y no son comparables, sería bueno no confundir.',NULL,105,'Event','2015-10-28 19:59:24','2015-10-28 19:59:24'),(6147,'Fco. Javier','FJVILCHESSERRANO@HOTMAIL.COM','¿Serían entonces COMPARABLES Autocad y QCAD ?','6146',105,'Event','2015-10-30 01:49:53','2015-10-30 01:49:53'),(6148,'mvaello','miguel.vaellomartinez@gmail.com','GNU/Linux. ',NULL,111,'Event','2015-11-01 22:09:22','2015-11-01 22:09:22'),(6149,'Mikexo ','miguel.xoel@gmail.com','Toda la razón. La comparación lógica sería con Maya Autodesk.','6146',105,'Event','2015-11-05 15:12:56','2015-11-05 15:12:56'),(6150,'Fco. Javier','FJVilchesSerrano@hotmail.com','Si la COMPARACIÓN LÓGICA sería con MAYA AUTODESK, he de recordaros que tiene Licencia de Software propietario (antónimo del concepto de software libre);	mientras que BLENDER tiene Licencia GPL ( Licencia Pública General de GNU ) ','6146/6149',105,'Event','2015-11-09 19:32:36','2015-11-09 19:32:36'),(6151,'mvaello','miguel.vaellomartinez@gmail.com','Claro, hablo de funcionalidad no de licencias. En cualquier caso, mira FreeCAD también.','6146/6149/6150',105,'Event','2015-11-11 23:31:01','2015-11-11 23:31:01'),(6152,'Beatriz','bcabriaa@yahoo.es','Me gustaría asistir a esta charla, pero no sé si hay que apuntarse en algún sitio o sencillamente hay que acudir al lugar el día de la charla.\r\n\r\nGracias por atenderme. Un saludo',NULL,102,'Event','2015-11-18 12:52:50','2015-11-18 12:52:50'),(6153,'Fco. Javier','FJVilchesSerrano@hotmail.com','El problema es que FreeCAD es una aplicación diseñada para la asistencia en ingeniería mecánica y diseño de elementos mecánicos; mientras que Blender es un programa dedicado al modelado, iluminación, renderizado, animación y creación de gráficos en 3D','6146/6149/6150/6151',105,'Event','2015-11-18 20:14:09','2015-11-18 20:14:09'),(6154,'Miguel Vaello','miguel.vaellomartinez@gmail.com','Esto mola: http://scrapy.org/',NULL,128,'Event','2016-02-28 10:18:11','2016-02-28 10:18:11'),(6155,'Jonathan','ea1het@ea1het.com','Hasta la fecha las APIs se venían desarrollando de muchas formas, quizas la más popular es SOAP. \r\n\r\nSOAP y REST no se pueden comparar directamente, ya que el primero es un protocolo (o al menos trata de ser) y el segundo es un estilo arquitectónico.  ',NULL,125,'Event','2016-03-10 16:37:44','2016-03-10 16:37:44'),(6156,'Gerardo Jiménez','gerardojim85@hotmail.com','Me interesa esta charla.',NULL,141,'Event','2016-03-14 12:42:16','2016-03-14 12:42:16'),(6157,'Carne ','mcsantia@gmail.com','No pude asistir al taller. Pondréis accesible la grabación? Gracias',NULL,141,'Event','2016-04-15 17:21:31','2016-04-15 17:21:31'),(6158,'Julian','jbrazuelo74@gmail.com','Hola,\r\n\r\nCuando se podrá votar para las charlas , talleres y donde hay que registrarse',NULL,167,'Event','2017-03-01 11:23:46','2017-03-01 11:23:46'),(6159,'Miguel','miguel.vaellomartinez@gmail.com','Hola Julian.\r\n\r\nNo hay que registrarse, simplemente votar. En la página principal\r\naparece un recuadro verde con las fechas.\r\n\r\nSon del 06 de marzo de 2017 al 12 de marzo de 2017','6158',167,'Event','2017-03-02 20:15:01','2017-03-02 20:15:01'),(6160,'Ysinotelodigo','ysinotelodigo@gmail.com','Creo que va a salir al final el curso =)',NULL,158,'Event','2017-03-07 23:04:35','2017-03-07 23:04:35'),(6161,'PadreIndignado','dalonso635@gmail.com','Buenas tardes a todos ustedes.\r\n\r\nVengo a presentar mi queja sobre la charla realizada por Alex Blanco Cerro, aka \"Axeli\".\r\nHa presentado un lenguaje soez, pido la revisión de la calificación de edades de la charla. ¿Es que nadie piensa en los niños?',NULL,186,'Event','2017-03-29 15:12:49','2017-03-29 15:12:49'),(6162,'Usuario Enfurecido','angelsys84@gmail.com','El mentor, Axel Blanco, ha sido irrespetuoso en la charla mencionada.\r\nExpresiones soeces han sido oidas en el aula antes, durante y después de la exposición.\r\nJamás me he sentido tan avergonzado.\r\n\r\nEspero poder dormir esta noche.\r\n\r\nSaludos.',NULL,161,'Event','2017-03-29 15:13:16','2017-03-29 15:13:16'),(6163,'Usuario Enfurecido','angelsys84@gmail.com','El mentor, Axel Blanco, ha sido irrespetuoso en la charla mencionada.\r\nExpresiones soeces y malsonantes han sido oídas en el aula antes, durante y después de la exposición.\r\nJamás me he sentido tan avergonzado.\r\n\r\nEspero poder dormir esta noche.\r\n\r\nSaludos.',NULL,186,'Event','2017-03-29 15:15:16','2017-03-29 15:15:16'),(6164,'MadreIndignada','dalonso635@gmail.com','Buenas tardes\r\n\r\nSoy la esposa de PadreIndignado. Cabe resaltar que Alex en la charla ha pronunciado palabras muy soeces, y ahora mi hijo en la merienda me ha respondido con un \'Nos ha jodido\'\r\n\r\nNo te lo perdonare jamas Alex Blanco, jamas. ',NULL,186,'Event','2017-03-29 15:16:54','2017-03-29 15:16:54'),(6165,'AbuelaIndignada','dalonso635@gmail.com','Buenas tardes\r\n\r\nLe escribo a usted (Mi hija me ha enseñado a usar el internes solo para esto) para decirle a usted que es un bribón y ha usado unos lenguajes que me sacan los colores. Ay señor señor.\r\n\r\nDebe ir a confesión y le lavaria la boca con jabón\r\n',NULL,186,'Event','2017-03-29 15:37:59','2017-03-29 15:37:59'),(6166,'Señora Sofocada.','angelsys84@gmail.com','No sé si es por la edad, por lo cerrada que estaba la sala 1.2.C16 o por el ponente, pero yo me he tenido calores, unos calores muy malos... No me he podido concentrar en el Linus ese. \r\n\r\nSolicito una reunión privada con el ponente.\r\n\r\nAsunción.\r\n',NULL,186,'Event','2017-03-29 15:45:02','2017-03-29 15:45:02'),(6167,'Herminia','dalonso635@gmail.com','Ay Asunción, ni que usted lo diga.\r\n\r\nEste hombre se ha puesto a hablar con unos lenguajes que he necesitado salir a que me diera un poco el fresco, y darme con el abanico mire usted.\r\n\r\nMe parece que ha sido muy descarado, por Dios. Cuánta desidia!\r\nBesis','6166',186,'Event','2017-03-29 15:47:45','2017-03-29 15:47:45'),(6168,'Bill Gates','billgates@microsoft.es','ha beginning 10 minutos later. so decepcionado.',NULL,189,'Event','2017-11-23 16:47:50','2017-11-23 16:47:50'),(6169,'Un curioso','angelsys84@gmail.com','De estas que Axel menciona MPL, y yo inocente de mi, busco en Google qué es, y acabo en una página de My Little Pony...',NULL,189,'Event','2017-11-23 16:56:07','2017-11-23 16:56:07'),(6170,'Alvaro','ysinotelodigo@gmail.com','A ver si hay suerte, sale esta charla seleccionada y se encuentra alguien que pueda darla =)',NULL,223,'Event','2018-03-15 15:30:52','2018-03-15 15:30:52'),(6171,'Daniel','100316890@alumnos.uc3m.es','Gente que ha votado la de Godot. No desistáis que quizás para las próximas Jornadas sale con ponente ;)',NULL,227,'Event','2018-04-02 07:12:01','2018-04-02 07:12:01'),(6172,'Roberto','roberto@zenvoid.org','Estoy en el grupo de videojuegos codeAttack, hacemos cosas con software libre y especialmente Godot, nos reunimos en Medialab-Prado. Acabo de ver esto y supongo que llego tarde, pero no dudeis en contactar con nosotros para otras ocasiones :)','6171',227,'Event','2018-04-02 20:34:31','2018-04-02 20:34:31'),(6173,'Daniel','100316890@alumnos.uc3m.es','Suerte hubo, pero se nos cayó el ponente :(','6170',223,'Event','2018-04-05 06:46:22','2018-04-05 06:46:22'),(6174,'car','lamu.carmen@gmail.com','cunado se va a confirmar el aula??',NULL,235,'Event','2018-04-12 18:46:23','2018-04-12 18:46:23'),(6175,'Juan Banga','insertardireccion@gmail.com','No drum and bass, no party.',NULL,251,'Event','2019-09-16 09:21:53','2019-09-16 09:21:53'),(6176,'El tito Torvalds','titotorvalds@correo.com','Pero yo con C ya puedo hacer todo',NULL,252,'Event','2019-09-17 07:29:46','2019-09-17 07:29:46');
