INSERT INTO `events` VALUES (12,'Depuración con GDB','Introducción a la búsqueda de errores usando el depurador GDB','Muchos errores son difíciles de encontrar. Uno de los mejores mecanismos para buscarlos es el uso de depuradores.\r\n\r\nEn Linux el depurador por excelencia es GDB, que además de ser multilenguaje permite se controlado en remoto.',0,3,'','','es','',4,4,'','https://www.youtube.com/watch?v=Q0GmaiK9lk4',NULL,'Leganés','2.3.A03','2014-11-10 18:45:00','2014-11-10 19:45:00',1,1,0,1,'','depuracion-con-gdb',2,'2014-10-20 12:00:30','2015-03-15 20:50:04',NULL),(13,'Big Data','Introducción a Big Data','Explicación de las distintas técnicas de tratamiento de datos empleando ejemplos y casos prácticos reales.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'big-data',2,'2014-10-20 12:22:29','2014-10-28 12:12:36',NULL),(16,'Licencias de \"Free Software\" u \"Open Source\": características y diferencias','Explicar las principales licencias de \"Free Software\" u \"Open Source\".','Se trata de una charla donde se dará a conocer qué es el Free Software, el Open Source, las principales licencias de \"Free Software\" u \"Open Source\", sus diferencias, características, y cuáles se pueden usar junto a otras.',0,0,'','','es','',0,8,'','https://www.youtube.com/watch?v=URDxkHB4_CY',NULL,'Leganés','2.3.D04','2014-11-12 16:00:00','2014-11-12 16:45:00',1,1,0,1,'','licencias-de-free-software-u-open-source-caracteristicas-y-diferencias',2,'2014-10-20 13:10:06','2015-03-15 20:49:15',NULL),(17,'Servidores Web de Alto Rendimiento en GNU/LINUX','Servidores Web de Alto Rendimiento en GNU/LINUX','Charla sobre la instalación y configuración de servidores web de alto rendimiento y bajo consumo como lighthttpd y nginx, en comparación con apache, y las ventajas y desventajas que tiene.\r\nAl final de la charla se hará una demostración en vivo de como montar y configurar un servidor en nginx que soporte varias miles de conexiones simultáneas y sirva el contenido en milisegundos.',0,3,'','','es','',4,4,'http://www.youtube.com/watch?v=-ymalcq5uvI','https://www.youtube.com/watch?v=-ymalcq5uvI',NULL,'Leganés','2.3.A03','2014-11-10 17:00:00','2014-11-10 18:30:00',1,1,0,1,'','servidores-web-de-alto-rendimiento-en-gnu-linux',2,'2014-10-20 13:16:53','2015-03-15 20:51:06',NULL),(20,'Aplicación web. Cómo se ha hecho GULTalks','¿necesitas hacer una aplicación web y no sabes por donde empezar?','En esta charla veremos cómo hacer una aplicación web desde cero con Ruby on Rails',0,0,'','','','',0,2,'','https://www.youtube.com/watch?v=K83aQyv-d6k',NULL,'Leganés','2.3.B05','2014-11-13 16:00:00','2014-11-13 16:45:00',1,1,0,1,'','aplicacion-web-como-se-ha-hecho-gultalks',2,'2014-10-20 13:53:06','2015-03-15 20:48:09',NULL),(24,'Inteligencia Artificial aplicada a videojuegos de estrategia en tiempo real','Introducción a la inteligencia artificial aplicada en juegos RTS (Real-Time Strategy)','En esta charla pretendo hacer una visita guiada rápida al mundo de la inteligencia artificial aplicada a juegos de estrategia en tiempo real (Age of Empires, Starcraft II, Risk...). Consistirá en una introducción a las técnicas aplicadas para esta problemática con un recorrido por los principales desafíos a los que ha enfrentado en los últimos años y problemas que surgen para el futuro. ( técnicas que pasan por aprendizaje por refuerzo, algoritmos evolutivos, data mining aplicado a aprendizaje automático, uso de automatas finitos (FSM) , CBR models, semi modelos ocultos de markov (HSMM), entre otros muchos ). La charla concluirá con un ejemplo práctico de agente inteligente en el juego de estrategia RISK. Se analizará el agente y su proceso de diseño, y se probará la eficacia en directo.\r\n\r\nSe recomienda para la asistencia conocimientos básicos de estadística en materia de probabilidades y razonamientos bayesianos\r\n\r\n\r\n\r\n\r\n',0,2,'','','es','(No me deja colocar links)Busquedas sobre estos temas en la wikipedia pueden resultar de interés.\r\n\r\nBayesian network\r\nBayes theorem\r\nBayesian inference\r\n',5,20,'','',NULL,'Leganés','2.3.A01','2014-11-11 17:00:00','2014-11-11 18:30:00',1,1,0,1,'','inteligencia-artificial-aplicada-a-videojuegos-de-estrategia-en-tiempo-real',2,'2014-10-20 22:10:01','2014-11-07 08:06:56',NULL),(26,'¿Que es Symfony?','Una pequeña iniciación a lo que es Symfony, que librerías ofrece y algún ejemplo de aplicación básica utilizando Symfony','Esta charla consistiría en explicar que es Symfony, quien lo desarrolla, como nos facilita la vida, una explicación de lo que hace cada librería y algún ejemplo básico de como nos facilita la vida. También estaría bien que se pudiera comparar con otros frameworks tanto de PHP como de Python, ASP, Java,...',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'que-es-symfony',2,'2014-10-21 08:23:20','2014-10-21 08:30:03',NULL),(31,'Install party','Instalar alguna de las distribuciones basadas en linux.','Un grupo de gente que se junte e instale alguna de las distribuciones basadas en linux. Si es la primera actividad, puede permitir que todos los asistentes tengan ya instalado linux.',1,1,'','','es','Adri Casado me ha obligado a darla :( Hemos pensado que si sobra tiempo (porque sea mucho) podemos dar unas nociones basicas de manejo en la terminal, etc.',5,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'install-party',2,'2014-10-21 12:40:18','2014-10-28 22:08:21',NULL),(34,'Introducción a Golang','Introducción a Golang','Introducción a Golang\r\nIntroducción a Golang\r\nIntroducción a Golang\r\nIntroducción a Golang',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-golang',2,'2014-10-21 15:54:23','2014-10-21 15:55:25',NULL),(35,'Desarrollo de extensiones de python en C(ython)','Desarrollo de extensiones de python en C(ython)','Desarrollo de extensiones de python en C(ython)\r\nDesarrollo de extensiones de python en C(ython)\r\nDesarrollo de extensiones de python en C(ython)\r\nDesarrollo de extensiones de python en C(ython)',0,0,NULL,NULL,NULL,NULL,0,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'desarrollo-de-extensiones-de-python-en-c-ython',2,'2014-10-21 15:55:29','2014-10-30 20:46:48',NULL),(36,'Optimización de gnu/Linux','Optimización de gnu/Linux para tareas intensivas en red, I/O en general y procesamiento','Optimización de gnu/Linux para tareas intensivas en red, I/O en general y procesamiento',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'optimizacion-de-gnu-linux',2,'2014-10-21 15:56:35','2014-10-28 13:39:13',NULL),(37,'El desarrollador Android que saltó por la ventana y se largó','Consejos y trucos para hacer tu vida en Android más sencilla','Android no es un camino de rosas. En esta charla se intentarán explicar trucos, librerías y formas de trabajar con el objetivo de hacer del desarrollo de aplicaciones para Android algo mucho más llevadero, sencillo, divertido, y que se traduzca en un aumento en la calidad de las apps.\r\n\r\nSe intentarán tratar desde temas básicos hasta cosas avanzadas, para que sea útil tanto a gente sin experiencia en Android como para aquellos que sí la tienen. Porque es posible desarrollar para Android sin que te entren (muchas) ganas de saltar por la ventana y largarte :P',0,3,'','','es','',0,22,'','',NULL,'Leganés','2.3.A01','2014-11-11 18:45:00','2014-11-11 19:45:00',1,1,0,1,'','el-desarrollador-android-que-salto-por-la-ventana-y-se-largo',2,'2014-10-21 17:37:14','2014-11-07 08:07:36',NULL),(40,'Contratos de arrendamiento de servicios para el desarrollo de software y contratos laborales','Aprender los aspectos básicos en la contratación de servicios de desarrollo de software','Desarrollar software para terceros no es igual que vender un kilo de mandarinas. Como futuros ingenieros y desarrolladores de software sois autores potenciales de obras. Es crucial adquirir determinados conocimientos sobre transmisión de derechos de autor, en especial en el ámbito contractual. Veremos dos de las modalidades más frecuentes de contratación:\r\n\r\n- Contrato de arrendamiento de servicios / encargo de obra para autónomos\r\n- Contrato laboral.\r\n\r\n*Por supuesto, esto es una idea que puede ampliarse, reducirse o cambiar un poco ;)\r\n',0,0,'','','es','',3,2,'','https://www.youtube.com/watch?v=ffLcFjNU3P4',NULL,'Leganés','2.3.B05','2014-11-13 18:45:00','2014-11-13 19:45:00',1,1,0,1,'','contratos-de-arrendamiento-de-servicios-para-el-desarrollo-de-software-y-contratos-laborales',2,'2014-10-21 21:22:39','2015-03-15 20:47:20',NULL),(41,'Orgmode','Org is a mode for keeping notes, maintaining TODO lists, and doing project planning with a fast and effective plain-text system.','In this speech, I explain a short introduction about orgmode and guidelines to contribute.\r\n',0,3,'http://www.davidam.com','http://orgmode.org/cgit.cgi/org-mode.git/tree/contrib/lisp/org-effectiveness.el','es','',3,0,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'orgmode',2,'2014-10-21 22:19:39','2014-10-21 22:31:37',NULL),(43,'Modificación del grub','Modificación del grub','Me gustaría conocer comandos de grub para iniciar el ordenador desde la recuperación y conocer las distintas funcionalidades de esta herramienta.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'modificacion-del-grub',2,'2014-10-22 09:23:46','2014-10-28 12:34:28',NULL),(45,'Ingeniería inversa','Ingeniería inversa','Ingeniería inversa para obtener información de un determinado sistema de software o de hardware, según considere el ponente. La idea sería que el ponente trajera ejemplos preparados donde con tests de caja negra se consiguiera discernir en mayor o menor medida la estructura interna del programa o sistema de hardware.\r\n',1,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'ingenieria-inversa',2,'2014-10-22 10:32:04','2014-10-28 22:27:00',NULL),(46,'Zoe en casa','Cómo instalar Zoe en casa y empezar a jugar con ella','Zoe mola, pero empezar con ella puede ser complicado si no tienes mucha soltura con UNIX. En esta charla/taller instalaremos Zoe desde cero y aprenderemos a crear algún comando útil',0,0,'','','','',0,8,'','https://www.youtube.com/watch?v=9gLKd3oJyiA',NULL,'Leganés','2.3.C01','2014-11-14 17:00:00','2014-11-14 18:30:00',1,1,0,1,'','zoe-en-casa',2,'2014-10-22 18:55:54','2015-03-15 20:46:56',NULL),(47,'Curso de C','Eventualmente vas a tener que programar en C y lo sabes.','En esta charla veremos el modelo de ejecución de C para que puedas provocar tus propios SEGFAULTs tanto en casa como en el trabajo',0,0,'','','es','',0,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'curso-de-c',2,'2014-10-22 19:16:45','2014-10-28 17:57:02',NULL),(48,'Programación funcional','Empieza a programar en estilo funcional desde ya (y sin cambiar de lenguaje)','La programación funcional tiene muchos beneficios, tanto para los programadores como para las máquinas. Aprende por qué Twitter, LinkedIn, FourSquare, y otras muchas empresas han migrado a lenguajes funcionales.',0,0,'','','es','',0,7,'','https://www.youtube.com/watch?v=yKE1uMoTn54',NULL,'Leganés','2.3.D04','2014-11-12 18:45:00','2014-11-12 19:45:00',1,1,0,1,'','programacion-funcional',2,'2014-10-22 19:23:55','2015-03-15 20:48:35',NULL),(53,'Docker','Una nueva forma de distribuir aplicaciones','Aprenderemos a usar docker para distribuir nuestras aplicaciones',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'docker',2,'2014-10-23 18:24:50','2014-10-28 12:24:14',NULL),(54,'Introducción a systemd','Introducción a los conceptos básicos de systemd y las diferencias entre otros sistemas \"init\"','Ahora que muchas distribuciones lo usan y otras se plantean hacerlo. La charla servirá para:\r\n-Aprender cómo funciona systemd\r\n-Cómo se gestionan los servicios del sistema\r\n-Cómo añadir servicios propios\r\n-Compatibilidad y diferencias con init.d y otros gestores',0,0,NULL,NULL,NULL,NULL,0,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-systemd',2,'2014-10-23 21:00:11','2014-10-31 23:46:47',NULL),(55,'Desarrollo de aplicaciones con interfaz gráfica en Python y GTK+','Introducción al uso de Python y GTK+','Añadir una interfaz gráfica a una aplicación hecha en Python puede ser un lío. En este taller se hará una introducción a las capacidades que ofrece el uso de GTK+ en Python, distintas formas de trabajar con ello y se hará una pequeña aplicación utilizando Glade y PyGObject.\r\n\r\nMaterial necesario:\r\n- Portátil (GNU/Linux o Windows)\r\n- Python 2.7 o superior\r\n- Glade: https://glade.gnome.org/\r\n- PyGObject: https://wiki.gnome.org/Projects/PyGObject',1,3,'','','es','',3,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'desarrollo-de-aplicaciones-con-interfaz-grafica-en-python-y-gtk',2,'2014-10-24 07:14:00','2014-10-31 14:53:35',NULL),(56,'Crea tu propia distribución basada en Debian con Simple-CDD','Con Simple-CDD puedes crear a tu gusto una distribución basada en Debian de manera fácil y rápida','Seguro que alguna vez te ha pasado que has tenido que ir a algún sitio y has necesitado echar mano de una distribución GNU/Linux y oportunamente el acceso a internet era extremadamente lento o sencillamente no tenías acceso para descargar los paquetes que te interesaban en ese momento, o que simplemente no querías esperar a descargar ciertos paquetes o querías añadir paquetes que no se encuentran en ningún repositorio pero querías añadirlos durante la instalación del sistema para ahorrar tiempo.\r\n\r\nEn ese caso Simple-CDD[1] es tu amigo. Esta herramienta te permite personalizar desde los paneles de instalación, hasta ejecutar scripts al final o al principio de la instalación, y por supuesto pasando por la instalación automática de paquetes que se encuentren tanto en los repositorios como dentro de la imagen que podemos crear. Y todo esto ejecutando un comando desde la terminal :-).\r\n \r\nNOTA: al tratarse de un taller, sería recomendable que los asistentes acudiesen con su propio equipo para poder instalar Simple-CDD y jugar con este. Teóricamente cualquier versión estable de Debian 7 (o derivados, como Ubuntu y derivados también) en adelante son válidas para el taller, porque en sus repositorios encontrarás el paquete sin mucho esfuerzo.  \r\n\r\n[1] https://wiki.debian.org/Simple-CDD',1,3,'','https://github.com/miguxbe/simple-cdd','es','Necesitaré proyector y cable VGA. Si es posible un aula en la que se pueda configurar la red por cable (RJ-45) debido a que el tráfico puede ser bastante alto. ',4,3,'','https://www.youtube.com/watch?v=BMiIXXZkciI',NULL,'Leganés','2.3.B05','2014-11-13 17:00:00','2014-11-13 18:30:00',1,1,0,1,'','crea-tu-propia-distribucion-basada-en-debian-con-simple-cdd',2,'2014-10-24 09:59:53','2015-03-15 20:47:40',NULL),(58,'Can I haz ur pythons?','Charla de nivel medio de python, con ejemplos prácticos con algún ORM entre medias, framework web y cosas asíncronas.','Python.\r\nCharla de nivel medio.\r\nSQLAlchemy.\r\nFlask.\r\nTricks.\r\nOur fav. libs.',0,3,'','','es','',3,12,'','',NULL,'Leganés','2.3.D04','2014-11-12 17:00:00','2014-11-12 18:30:00',1,1,0,1,'','can-i-haz-ur-pythons',2,'2014-10-24 16:30:34','2014-11-07 08:09:35',NULL),(63,'Administracion Server desde whatshapp','Automatización de tareas, Envia comandos desde whatshapp y haz que sean comprensibles por tu linux.','Con esta mini charla aprenderemos a crear un boot con una serie de acciones programadas. El metodo de contacto o linea de mando será mediante el envio de mensajes whatshapp desde tu telefono móvil. Devolviendo una respuesta sobre lo que ocurrirá.',0,1,'','','es','',2,6,'','https://www.youtube.com/watch?v=mA5V5Gf6D-E',NULL,'Leganés','2.3.A01','2014-11-11 16:00:00','2014-11-11 16:45:00',1,1,0,1,'','administracion-server-desde-whatshapp',2,'2014-10-26 11:31:17','2015-03-15 20:49:39',NULL),(74,'Hackea tu educación en la universidad','Si lo que aprendes en la uni se te queda corto, te cuento las claves para hackear tu educación en este periodo.','El periodo universitario se dice que es uno de los mejores de nuestra vida. Hay gente que lo disfruta así tal cual. Pero hay otros que necesitamos hacer otras cosas: tener otros retos, otras aficiones, otros cacharreos. Si eres de este segundo grupo o te gustaría serlo, esta charla va dirigida a ti. \r\n\r\nEl libro de Dale J Stephens \"Hacking your education\" propone una serie de razones por las que el coste de oportunidad de realizar una carrera universitaria no merece la pena. Yo lo tengo una visión tan radical, pero sí me doy cuenta de que hay cosas que podría haber hecho durante mi periodo universitario que me hubieran permitido desarrollarme mejor como personal y profesional. Desde participación activa en asociaciones de alumnos, hasta la realización de pet projects o incluso proyectos empresariales. Daré una serie de pautas que a mí me habría gustado conocer entes de empezar mi andadura en la universidad. ',0,1,'','','es','',2,12,'','https://www.youtube.com/watch?v=xqbliMWoHxY',NULL,'Leganés','2.3.C01','2014-11-14 16:00:00','2014-11-14 16:45:00',1,1,0,1,'','hackea-tu-educacion-en-la-universidad',2,'2014-10-28 08:44:29','2015-03-13 17:09:11',NULL),(75,'Markdown & Pandoc: not another Word','Escribir documentos no tiene por qué ser tan malo','Memorias, trabajos, escritos académicos en general... todos hemos tenido que escribirlos alguna vez y hemos sufrido las consecuencias de usar Word, Writer u otro tipo de editor del mismo estilo: márgenes, tablas, alineación, alineación de tablas, márgenes, problemas de formato, gráficos, más márgenes...\r\n\r\nEn esta pequeña charla presentaremos una posible alternativa a estas herramientas \"tradicionales\". Usando Markdown para escribir el contenido, Pandoc para poder transformar ese contenido a una gran variedad de formatos y una pizca de LaTex si nos gusta darle un poco de emoción a las cosas, obtendremos una forma fácil y rápida (e incluso divertida) de escribir documentos.\r\n\r\nAdemás hablaremos de Markdown Slides, una utilidad con la que podréis crear presentaciones de diapositivas en diferentes formatos y con aspecto más que profesional. ¡Y todo ello usando Markdown! ¿Es que se puede pedir más?',0,2,'http://archive.rmedgar.com/talks/pandoc_markdown','https://github.com/asanzdiego/markdownslides','es','',3,8,'','',NULL,'Leganés','7.2.J01','2015-04-20 18:00:00','2015-04-20 19:00:00',1,1,0,1,'','markdown-pandoc-not-another-word',3,'2015-03-15 22:27:47','2015-04-21 12:24:49',NULL),(76,'The Graphs of Wrath (Los Grafos de la Ira)','Introducción a los grafos sociales siguiendo ejemplos prácticos','En esta charla explicaré conceptos de grafos sociales a un nivel introductorio y no excesivamente técnico. \r\nExplicaré cómo conceptos de la teoría de grafos se aplican a grafos sociales para extraer valor sociológico de una estructura fundamentalmente matemática / computacional; y podrás entender a qué se debe la típica afirmación de que \"el mundo es un pañuelo\".\r\nHaré una demo con algunos grafos reales extraídos de Facebook para que los asistentes puedan ver cómo claramente se identifican las comunidades de usuarios dentro la red social. \r\nAdemás, emplearemos la herramienta opensource Gephi para realizar todas estas operaciones.',0,1,'http://bal.do/gul15','','es','- La URL estará disponible después / durante de la charla.\r\n- Soy flexible en cuanto a la duración, podría ser de 30 minutos si hiciera falta, aunque en una hora se puede presentar mejor.',3,9,'','',NULL,'Leganés','7.1.J01','2015-04-21 18:00:00','2015-04-21 19:00:00',1,1,0,1,'','the-graphs-of-wrath-los-grafos-de-la-ira',3,'2015-03-16 12:46:06','2015-04-17 13:07:45',NULL),(77,'Se cool, usa programación funcional','Introducción a la programación funcional con consejos para aplicar a tus día y a día.','¿Estás cansado de no ser lo suficientemente cool? ¿Hacer concurrencia es un infierno? ¿Te faltan paréntesis en tu vida? ¿Siempre se te olvidan casos que probar en tus test? ¿No recuerdas cuándo fue la última vez que usaste un patrón de diseño? \r\n\r\nSi tienes estas inquietudes o simplemente curiosidad te recomiendo que vengas a esta charla. Empezaré explicando conceptos sencillos de programación funcional (como la inmutabilidad), hasta conceptos más avanzados como las monadas. \r\n\r\nUsaré para los ejemplos Scala, pero mostraremos ejemplos de Programación funcional en otros lenguajes. El objetivo de este taller, es mostrarte lo fácil e interesante que es aplicar aspectos de programación funcional a tu código para mejorar tu código. Y volver a ser el mas cool de la empresa.',1,2,'','','es','',3,15,'','',NULL,'Leganés','7.1.J01','2015-04-21 19:05:00','2015-04-21 20:05:00',1,1,0,1,'','se-cool-usa-programacion-funcional',3,'2015-03-16 16:11:26','2015-04-17 13:08:15',NULL),(78,'JavaScript, JS everywhere!','Lo más hipster del front-end y del back-end con JS.','Preparad vuestras gafas de pasta, vuestra camisa de leñador y ese MacBook (con Linux instalado) que tanto os gusta lucir, esto va a ser divertido.\r\n\r\nEn esta charla se introducirán las librerías y frameworks más actuales para construir aplicaciones web.\r\n\r\n#AngularJS está pegando fuerte, no es para menos, hacer aplicaciones totalmente reactivas es bastante sencillo gracias a este framework. También tenemos #Polymer, #Ember.js y #Backbone.js así que también hablaremos de ellos.\r\n\r\nEn el servidor, alabamos a #NodeJS y su MAGIA. Disponemos de los frameworks #Express y #Koa entre otros.\r\n\r\nResulta que los #WebSockets son nuestros nuevos amigos para enviar y recibir datos entre el cliente y el servidor en tiempo real. #Socket.io está para echarnos una mano.\r\n\r\nParece que son muchos nombres, pero no os asustéis, sólo se dará una visión superficial.\r\n\r\nSe resolverán preguntas del tipo: ¿Por cuál empiezo?, ¿Me olvido ya de otros lenguajes para la web?, ¿Podemos jugar al Pókemon desde el navegador entre varios?',0,2,'http://yago.me/gul2015','','es','',2,12,'','',NULL,'Leganés','7.0.J01','2015-04-23 18:00:00','2015-04-23 19:00:00',1,1,0,1,'','javascript-js-everywhere',3,'2015-03-17 23:56:05','2015-04-17 13:12:03',NULL),(79,'Tu primera máquina virtual','Introducción a virtualización','Pequeña introducción a la gestión de máquinas virtuales, ya sea en el ámbito personal o en el de servidores: creación, inicio, gestión de recursos, etc. Así como algunos ejemplos de tecnología disponibles para ello.',0,2,'','','es','',0,5,'','',NULL,'Leganés','7.2.J01','2015-04-24 16:00:00','2015-04-24 17:30:00',1,1,0,1,'','tu-primera-maquina-virtual',3,'2015-03-20 08:06:24','2015-04-17 13:13:19',NULL),(80,'Gestión de proyectos ágiles con Taiga','Introducción a como gestionar proyectos en Taiga y sacarle el máximo partido','Taiga es una plataforma libre de gestión de proyectos (Con licencia AGPL) especializada en metodologías ágiles. La idea de esta charla es hacer un recorrido por la herramienta y explicar como se gestionan diferentes tipos de proyecto, como personalizo mis proyectos, y como me integro con otras plataformas como github o slack. ',0,1,'','','es','',4,4,'','',NULL,'Leganés','7.0.J01','2015-04-22 18:00:00','2015-04-22 19:00:00',1,1,1,1,'','gestion-de-proyectos-agiles-con-taiga',3,'2015-03-21 09:02:07','2015-04-22 13:51:17',NULL),(81,'Entendiendo el código y la arquitectura de Taiga','Un recorrido por los diferentes componentes de taiga, su código y su arquitectura.','Taiga es una plataforma libre de gestión de proyectos (Con licencia AGPL) especializada en metodologías ágiles. La idea de esta charla es recorrer el los diferentes componentes de la plataforma (taiga-front, taiga-back, taiga-events y varios plugins) y explicar la arquitectura, el código y las decisiones tecnológicas tomadas.',0,4,'','','es','',5,0,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','entendiendo-el-codigo-y-la-arquitectura-de-taiga',3,'2015-03-21 09:06:08','2015-03-27 09:26:16',NULL),(82,'Desplegando mi propio Taiga','Explicación de como son los diferentes componentes de taiga, y como se despliegan','Taiga es una plataforma libre de gestión de proyectos (Con licencia AGPL) especializada en metodologías ágiles. La idea de esta charla es expliar como desplegar los diferentes componentes de taiga (taiga-front, taiga-back, taiga-events y plugins) y porque se despliegan de este modo. Veremos los metodos automatizados de despliegue (taiga-vagrant y taiga-scripts) para terminar con un despliegue completamente manual, explicado paso a paso.',0,3,'','','es','',4,1,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','desplegando-mi-propio-taiga',3,'2015-03-21 09:08:54','2015-03-30 16:22:35',NULL),(83,'Diseño de PCBs con KiCAD','Aprende a diseñar tus propios circuitos y a fabricarlos de forma profesional','KiCAD es un software libre para el diseño de circuitos electrónicos y PCBs. En este workshop aprenderemos el manejo básico de KiCAD, diseñando un circuito simple y su correspondiente PCB.\r\n\r\nEl workshop constará de las siguientes partes:\r\n- Diseño del esquemático\r\n- Asignación de footprints a componentes\r\n- Diseño de la PCB\r\n- Generación de los archivos de fabricación',1,2,'http://www.dsquaredrobotics.com/wiki/doku.php?id=es:talk:gultalk','','es','',5,20,'','',NULL,'Leganés','7.0.J01','2015-04-22 16:00:00','2015-04-22 17:30:00',1,1,0,1,'','diseno-de-pcbs-con-kicad',3,'2015-03-21 13:13:10','2015-04-22 13:51:56',NULL),(84,'Introducción a Ansible','Taller práctico de introduccion a la herramienta de gestión de configuración Ansible','Ansible es una herramienta de gestión de la configuración que, aunque es reciente, está pegando fuerte y se ha convertido en una baza muy importante en el arsenal de sysadmins y practicantes de metodologías de tipo DevOps.\r\n\r\nEn este taller aprenderemos qué es Ansible, para qué sirve, cómo se usa y daremos nuestros primeros pasos con la herramienta. \r\n\r\nCrearemos una serie de máquinas virtuales en el portátil de cada participante, que iremos configurando a lo largo del taller, empezando por automatizar tareas sencillas como instalar ntp en todas las máquinas, pasando por una instalacion de nginx, mongodb e incluso veremos ejemplos de creación de instancias en la plataforma AWS y despliegues con zero-downtime.\r\n\r\nNOTA: Será necesario asistir al taller con un portátil en el que tengamos instalados los pre-requisitos que aparecen en la slide 2.',1,2,'http://slides.com/alejandroguiraorodriguez/introduction-to-ansible','https://github.com/lekum/introduction-to-ansible','es','Será necesario asistir al taller con un portátil en el que tengamos instalados los pre-requisitos que aparecen en las slide 2 de http://slides.com/alejandroguiraorodriguez/introduction-to-ansible',5,3,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','introduccion-a-ansible',3,'2015-03-22 10:34:49','2015-04-09 07:00:15',NULL),(85,'MongoDB','Introducción','Una introducción a MongoDB para aprender a gestionar una base de datos no SQL',1,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'mongodb',3,'2015-03-23 08:14:07','2015-04-10 10:46:27',NULL),(86,'Desarrollo con AngularJS','Quickstart de Angular','Taller introductorio para empezar a hacer cosas con AngularJS, sobre todo de cara al desarrollo de aplicaciones móviles, ya sea con o sin backend.',1,0,NULL,NULL,NULL,NULL,0,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'desarrollo-con-angularjs',3,'2015-03-23 12:26:40','2015-04-12 02:22:12',NULL),(87,'Makefile 101','Aprende a escribir Makefiles','Taller para aprender a escribir Makefiles básicos, sobre todo para automatizar compilación de prácticas.',1,0,NULL,NULL,NULL,NULL,0,7,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'makefile-101',3,'2015-03-24 12:18:20','2015-04-12 02:25:31',NULL),(88,'Git para novatos','Uso básico de Git','Para muchos proyectos colaborativos, es muy util la utilización de Git. Algunos hemos sufrido al intentar aprender a manejarlo y otros incluso no lo conocemos.\r\n\r\nLa idea de esta charla es introducir no sólo la idea de Git con todo el arsenal de comandos básicos, sino evitar posibles errores que suelen ocurrir en las primeras fases de aprendizaje.',0,0,NULL,NULL,NULL,NULL,0,14,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'git-para-novatos',3,'2015-03-26 22:21:36','2015-04-09 19:14:35',NULL),(89,'Monta tu propio ordenador','Monta tu propio ordenador','¿Te gustaría saber qué lleva la caja de tu ordenador por dentro? ¿Alguna vez te has planteado que te gustaría montarte un ordenador por piezas pero no tenías muy claro cómo?\r\n\r\nLa charla iría orientada a todos aquellos que alguna vez se han planteado alguna de estas dos cuestiones. Empezaríamos describiendo cuáles son los componentes que (valga la redundancia) componen un ordenador y cuál es la función de cada uno de ellos para a continuación ir viendo cuáles son los criterios para elegir unos componentes u otros a la hora de querer montar un ordenador por piezas. Por último, se montaría rápidamente un ordenador en la propia charla a modo de pequeña demostración.',0,1,'','','es','',4,26,'','',NULL,'Leganés','7.2.J01','2015-04-24 19:05:00','2015-04-24 20:30:00',1,1,0,1,'','monta-tu-propio-ordenador',3,'2015-03-26 22:23:42','2015-04-17 13:14:38',NULL),(90,'Programación Literaria','Presentación del principio de programación literia y de herramientas asociadas','La programación literaria es un modelo extraordinariamente eficaz. En palabras de Donald Knuth: \"sirve para hacer los programas por fin bien\" y tiene innumerables aplicaciones. Su importancia, sin embargo, ha resultado más o menos desapercibida a pesar de que, quien la practica, urge a otros a considerarla por el impacto positivo en su trabajo. En la presentación se mostrará el principio de la programación literaria, así como algunas herramientas y, por fin, se discutirán dos casos reales para la generación de documentos ... de un modo muy especial, ¡usando programación literaria!',0,2,'','','es','Me daría igual dar la charla en Español o en inglés. Por último, la duración puede ser cualquiera alrededor de una hora.\r\n\r\nEl comentario más importante tiene que ver con el horario. En caso de que aceptárais esta charla, os agradecería que me contactárais para organizar la hora a la que puede darse. ',3,15,'','',NULL,'Leganés','7.1.J01','2015-04-21 16:00:00','2015-04-21 17:30:00',1,1,0,1,'','programacion-literaria',3,'2015-03-27 08:59:39','2015-04-17 13:06:57',NULL),(91,'¿Conoces a mi amigo Debian?','Introducción al uso de un SO Linux (Debian)','Mucha gente es reacia al uso de un sistema operativo, no particularmente Linux, si no diferente a Windows. Y la única razón de esto muchas veces es que Windows es algo conocido, familiar, donde nos sentimos cómodos, y usar otro sistema genera inseguridad porque no sabemos donde están las cosas y lo que resultaba algo intuitivo ya no lo es.\r\n\r\nCon esta charla/Taller pretendo presentaros un SO Linux, Debian concretamente, recién instalado, explicando también como instalarlo junto a un Windows, e ir conociéndolo desde el principio para perder ese pánico inicial y descubrir muchas de las cosas que este buen compañero de aventuras es capaz de ofrecernos.',1,1,'','','es','Recomiendo ir a la Install Party del viernes 17, donde adelantaré algunas cosas y así tendréis el ordenador listo para seguir el taller, aunque no es necesario ya que el taller en parte, también es una charla que pretende animar al uso de un SO Linux.',0,18,'','',NULL,'Leganés','7.2.J01','2015-04-20 16:00:00','2015-04-20 17:30:00',1,1,0,1,'','conoces-a-mi-amigo-debian',3,'2015-03-27 13:42:05','2015-04-17 13:04:37',NULL),(92,'OpenSource, Innovación y empresa','Charla sobre innovación tecnológica, código abierto y empresa','Charla acerca de la innovación y de los caminos para poder competir como pequeña empresa, contra las grandes empresas utilizando herramientas como el código abierto. No es una charla técnica, sino una aproximación al proceso de emprender visto desde la innovación tecnológica. Como los procesos creativos basados en código abierto, o en ecosistemas colaborativos, pueden desembocar en proyectos empresariales con éxito.\r\n',0,2,'','','es','',3,10,'','',NULL,'Leganés','7.2.J01','2015-04-24 18:00:00','2015-04-24 19:00:00',1,1,0,1,'','opensource-innovacion-y-empresa',3,'2015-03-28 23:39:01','2015-04-17 13:14:06',NULL),(93,'Pandora FMS: Workshop de monitorización de sistemas','Iniciación a una herramienta de monitorización OpenSource: Pandora FMS','Pandora FMS es una herramienta de monitorización publicada bajo licencia GPL2 orientada al mundo empresarial, cubre varios frentes: servidores, aplicaciones y redes. Veremos sus usos básicos y aprenderemos lo suficiente para saber por donde seguir en su uso. Esencial tener conocimientos mínimos de networking, sistemas y linux. Pandora FMS es desarrollada por una empresa de Madrid, junto con colaboradores de otros países.',1,3,'http://pandorafms.com','http://github.com/pandorafms/pandorafms','es','El ponente seguramente será otra persona, pero me pongo yo de momento para no dejarlo en blanco. Será alguien de nuestra organización, probablemente un desarrollador del proyecto.',5,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'pandora-fms-workshop-de-monitorizacion-de-sistemas',3,'2015-03-28 23:43:53','2015-04-08 15:33:30',NULL),(94,'BLENDER','Diseño en 3D de calidad sin necesidad de pagar por la licencia de AUTOCAD','Como diseñar en 3D sin necesidad de pagar licencia de AUTOCAD, utilizando un buen programa como BLENDER y usando las respectivas Bibliotecas de OPENOFFICE.\r\n',0,0,NULL,NULL,NULL,NULL,0,10,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'blender',3,'2015-03-29 03:19:31','2015-04-12 02:26:37',NULL),(95,'Introducción básica a Neo4j y Cypher','Básica presentación de la base de datos de grafos Neo4j y a su lenguaje de query propio Cypher.','En la charla veremos a modo de presentación o primera toma de contacto qué es una base de datos de grafos y más concretamente la base de datos Neo4j. Se presentará de manera básica su funcionamiento, sus elementos más importantes y sobre todo su lenguaje de queries Neo4j.',0,2,'','','es','Puedo adaptarme un poco a la demanda que haya. Creo que como introducción básica, con una hora sería suficiente. Si se quiere dinamizar la charla, podría plantearme una duración de hasta una hora y media o incluso dos horas.\r\n\r\nMi disponibilidad es preferentemente los miércoles o jueves (tardes).',0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-basica-a-neo4j-y-cypher',3,'2015-03-29 05:33:33','2015-04-09 10:31:58',NULL),(96,'Programando en Android Wear','Haremos una rápida revisión de las familias de wearables y nos centraremos en la programación de aplicaciones con Android Wear.','Es un workshop separado en dos partes: \r\n\r\n1.- Veremos el estado actual de las diferentes familias de wearables (30 min).\r\n2.- Haremos una aplicación en Android Wear (60 min).\r\n\r\nHablaremos de las condiciones especiales en las que se usan las aplicaciones en wearables y cómo hacer apps adaptadas a su pantalla limitada por el tamaño, basar la entrada de datos en comandos por voz, explicaremos las formas de comunicarnos con el móvil dentro de la app para tener conectividad y balancear la carga de procesos entre el móvil y el reloj. Explicaremos también cómo dar funcionalidades de wearable fácilmente una app de móvil mediante las notificaciones y todo ello mediante ejemplos que haremos directamente en Android Studio.\r\n\r\nEs aconsejable tener ciertas nociones de programación de aplicaciones en Android, aunque el nivel requerido es bastante básico. ',1,3,'','','es','',4,23,'','',NULL,'Leganés','7.0.J01','2015-04-23 16:00:00','2015-04-23 17:30:00',1,1,0,1,'','programando-en-android-wear',3,'2015-03-29 22:05:37','2015-04-17 13:11:17',NULL),(97,'Schrödinger\'s Flask: ¿vive la serpiente?','Aplicaciones web indoloras con Python + Flask','Las *aplicaciones web* molan mucho. Hay muchos frameworks y lenguajes de programación que permiten crear cosas muy chulas (Ruby on Rails, PHP con sus miles de frameworks, Django, etc...), y otros que son algo menos amigables o directamente horribles (sí Java EE, te estoy mirando a ti).\r\n\r\nCon este pequeño taller, quiero presentar otra alternativa más: el microframework [Flask](http://flask.pocoo.org/). Se tratarán temas como:\r\n\r\n- Estructura de un proyecto web con Flask\r\n- MVC\r\n- Interacción con la base de datos (indolora, claro)\r\n- Páginas con contenido dinámico\r\n- Alguna otra cosa que surja (¿quizá *despliegue de aplicaciones*?)\r\n\r\nSería conveniente tener conocimientos básicos de Python, pero se dará una visión preliminar de cosas como importación de módulos, funciones, etc.',1,3,'http://archive.rmedgar.com/talks/schrodingers_flask','https://github.com/rmed/schrodingers_flask','es','',4,23,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-23 17:15:00','2015-11-23 18:45:00',1,1,0,1,'','schrodinger-s-flask-vive-la-serpiente',4,'2015-10-26 09:04:06','2015-11-25 10:54:30','g5UOCLHLdlh2_WgqwlMnpHMzH9RLyvcjKzhBa020hyM'),(99,'Ingeniería inversa','LNIAVAL  AGE E A  ERIRM ININSO.','Ingeniería inversa para obtener información de un determinado sistema de software o de hardware, según considere el ponente. La idea sería que el ponente trajera ejemplos preparados donde con tests de caja negra se consiguiera discernir en mayor o menor medida la estructura interna del programa o sistema de hardware.\r\n',1,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'ingenieria-inversa',4,'2015-10-26 12:31:30','2015-11-07 08:39:49',NULL),(100,'Internet de las cosas. Expectativas y retos.','Una visión de IoT más allá del powerpoint','Recorrido sobre las expectativas que se están creando, lo que existe y lo que hay que crear para llegar a esas expectativas.',0,1,'','','es','',5,18,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-26 16:00:00','2015-11-26 18:00:00',1,1,0,1,'','internet-de-las-cosas-expectativas-y-retos',4,'2015-10-27 11:08:21','2015-11-17 21:06:44','2AoE1FvedqdGki2UL2A2R2KZoQcO1b-n1jV3vo_G0f0'),(101,'DO RE MI, UN OSCILADOR POR AQUÍ ','FA SOL LA UN FILTRO POR ALLÁ','Raspberry pi. MIDI. Audio. Música electrónica. No necesitas saber más. ',1,0,'','','es','',3,12,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'do-re-mi-un-oscilador-por-aqui',4,'2015-10-27 13:05:31','2015-11-11 18:37:35','at9EU1mSf-s7kHrj-vCwDii4D-AiLVLyWSw2Ph0BvJM'),(102,'Mamá, quiero ser el Juan Palomo de los ordenadores. Paso 1: yo me los guiso.','Charla sobre las consideraciones y consejos a tener en cuenta para elegir las piezas de tu próximo ordenador.','¿Alguna vez has querido montar un ordenador pero no has sabido por dónde empezar? ¿Te hablan de especificaciones y no tienes ni idea de lo que te están contando? Pues esta charla es para ti.\r\n\r\nA lo largo de la charla se mostrarán cuáles son las principales características en las que uno se tiene que fijar a la hora de elegir los distintos componentes para montar un ordenador de sobremesa, así como cuáles son las distintas piezas que hay que escoger y algunas herramientas que nos ayudarán a tomar las mejores decisiones para tener un ordenador que se ajuste a nuestras necesidades y presupuesto.',0,2,'','','es','',4,15,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-27 16:00:00','2015-11-27 17:30:00',1,1,0,1,'','mama-quiero-ser-el-juan-palomo-de-los-ordenadores-paso-1-yo-me-los-guiso',4,'2015-10-27 17:33:48','2015-11-17 21:08:07','55SNrrDUCE5KJNcSgtbgW5nUh-g_r8wa_JF_vOZbyNU'),(103,'Mamá, quiero ser el Juan Palomo de los ordenadores. Paso 2: yo me los monto.','Taller semiteórico en el que se mostrarán cuáles son los pasos a seguir para, con las piezas necesarias, montar un ordenador.','Vale, ya sé qué piezas quiero para mi próximo ordenador, las he pedido y me han llegado. Ahora ¿qué hago con ellas?\r\n\r\nAnte esa tesitura, el taller pretende mostrar, de una manera genérica, cuáles son los pasos a seguir para montar un sobremesa por piezas.\r\nEl taller tendrá también carga teórica para intentar mostrar un caso lo más generalizado posible sobre las distintas posibilidades. Está pensado como una continuación de la charla de nombre similar que supondría la primera parte.',1,2,'','','es','',4,23,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-27 18:00:00','2015-11-27 19:00:00',1,1,0,1,'','mama-quiero-ser-el-juan-palomo-de-los-ordenadores-paso-2-yo-me-los-monto',4,'2015-10-27 17:42:55','2015-11-17 21:08:49','DlH2ATZyA1hJ73xCwKqkOOi5ibFiRjyOoQkDHbx-7sw'),(104,'¡Pues haré mis propios videojuegos! Con casinos y aventuras conversacionales.','Todo el proceso desde elegir el lenguaje de programación hasta tener nuestra aventura conversacional lista para jugar.','>Observar\r\n\r\nEl aula está llena de gente, por suerte aún quedan asientos vacíos y la organización ha tenido el detalle de traer regletas.\r\n\r\n>Tomar asiento\r\n\r\nConsigues sentarte en primera fila, a tu lado hay un muchacho que te dice que le gusta tu camiseta, es guapete aunque la barba no le favorece. Mientras enciendes tu ordenador empieza la charla, un apasionante periodo de tiempo donde los creadores de \"El discurso de Zoe\", contarán como se desarrollo esta obra maestra de principio a fin. Aportando una pequeña introducción a los videojuegos conversacionales y de aventura gráfica, aconsejando y explicando como producir un juego de este género, hurgando en el código fuente de \"El discurso de Zoe\" y mucho más.\r\n\r\n>Sentirme culpable por no haber avisado a mis amigos',0,2,'','https://github.com/rmed/discurso_zoe','es','Rafa, estás enmarronado. Un poquito por lo menos...',0,8,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-25 18:00:00','2015-11-25 19:30:00',1,1,0,1,'','pues-hare-mis-propios-videojuegos-con-casinos-y-aventuras-conversacionales',4,'2015-10-27 23:48:15','2015-11-17 21:06:03','KTw6udaqvKV4lYUFCBwqoah2bTOCSMBC706lQOa1HxM'),(105,'BLENDER','Diseño en 3D de calidad sin necesidad de pagar por la licencia de AUTOCAD ','Como diseñar en 3D sin necesidad de pagar licencia de AUTOCAD, utilizando un buen programa como BLENDER y usando las respectivas Bibliotecas de OPENGL. ',0,0,NULL,NULL,NULL,NULL,0,14,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'blender',4,'2015-10-28 15:36:04','2015-11-10 10:42:45',NULL),(106,'Crea tu propio motor de videojuegos con HTML5 y javascript','Videojuegos, muchas risas y programación sin morir en el intento.','El sueño de cualquier programador es desarrollar videojuegos. \r\n\r\nSE NOS HA IDO LA OLLA: con un poco de HTML5 y Javascript, un puñado de conceptos aprendidos en la Facultad y mucha imaginación nos hemos propuesto montar un motor de videojuegos 2D con unos resultados sorprendentes.\r\n\r\nY todo esto sin morir en el intento. ¿Lo conseguiremos?\r\n',1,2,'','','es','Adsequible a todos los públicos\r\n\r\nSabiendo conocimientos básicos de programación,  los pilares de la orientación a objetos y que existe html5 y javascript veremos que todo es posible.',4,16,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-24 18:15:00','2015-11-24 19:45:00',1,1,0,1,'','crea-tu-propio-motor-de-videojuegos-con-html5-y-javascript',4,'2015-10-28 18:59:04','2015-11-17 21:04:19','82XQ1Y6IKKGICVIH4Y8EMVUEZ88U74XZ'),(107,'¡Como si no llevaras nada, oye!','Una pasada a la actualidad con tu privacidad y maneras de mitigar la huella que dejas en internet.','¿Te sientes *observado*? ¿Sientes que tu corazón se va del susto cuando Facebook o Google saben más de ti que tú mismo? Deberías. Pues hoy en día, hasta tu gato te vigila.\r\n\r\nEn esta charla te enseñaré a protegerte, o al menos, mitigar tus acciones en la red, para que tu privacidad esté más oculta al mundo. Pasaremos por navegar con extensiones que protegen tu huella en internet, al cómo mandar cosas por correo de manera que sólo las partes interesadas puedan ver su contenido, hasta cómo llegar al anonimato hardcore con nuestras amigas las cebollas.\r\n\r\n¿No tienes nada que ocultar? Perfecto. Pero nadie tiene por qué mirar.',0,0,'','','es','',0,43,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-23 16:00:00','2015-11-23 17:00:00',1,1,0,1,'','como-si-no-llevaras-nada-oye',4,'2015-10-29 22:18:39','2015-11-17 21:01:44','PmoqoLrUdEi4LdXCnSPMJpylQ3KOxfsTeDvqV9LCnF4'),(108,'¿Qué es Docker?','Contenedores Linux','Visión general del estado de las arquitecturas basadas en contenedores, especialmente Docker, comparado con la virtualización.',0,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'que-es-docker',4,'2015-10-30 09:05:49','2015-11-06 11:02:26',NULL),(109,'Neutron, redes virtuales en OpenStack','Neutron, network namespaces, vNIC, GRE, VXLAN? Introducción a la capa de red de OpenStack','Neutron es un proyecto de OpenStack para proveer \"red como servicio\" entre diferentes interfaces (p,ej vNICs) gestionados por otros servicios. Esta charla es una introducción a Neutron, qué es y cómo funciona internamente a alto nivel.',0,3,'','','es','',1,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'neutron-redes-virtuales-en-openstack',4,'2015-10-30 09:34:46','2015-11-02 10:12:36','LHMfb3wz4bUevSqlGbAc2G8dlbuBYRJa-qhqaVYG5Rg'),(110,'¿Qué hay detrás del movimiento DevOps?','Introducción al movimiento DevOps y el impacto que está teniendo en las compañías.','DevOps está comenzando a sonar en muchos sitios, perfil DevOps, equipo DevOps, herramientas DevOps, ¿pero qué hay realmente detás de la cultura DevOps?',0,0,'','','es','',2,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'que-hay-detras-del-movimiento-devops',4,'2015-10-30 12:49:45','2015-11-05 13:19:18','qRU68sOY1GDMdTaugaROxgqU2vJf4UZEeUEkR3zx1WM'),(111,'Pon un linux en tu red Local (y en tu vida)','Configuración de un servidor en una red doméstica','Que debería llevar el servidor domestico perfecto? Configuración paso a paso de una pequeña maquina linux, servidor DNS, guardián ARP, Samba, Torrent, Plex...',0,0,NULL,NULL,NULL,NULL,0,17,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'pon-un-linux-en-tu-red-local-y-en-tu-vida',4,'2015-11-01 09:47:19','2015-11-10 22:55:11',NULL),(112,'Programación de controladores en C ','Un taller con ejemplos prácticos de programación en C de controladores','El objetivo del taller será profundizar en y, en menor medida, introducir al asistente a, la programación de controladores (Arduino, por ejemplo) utilizando el lenguaje C.',1,0,NULL,NULL,NULL,NULL,0,14,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'programacion-de-controladores-en-c',4,'2015-11-01 11:29:57','2015-11-08 17:44:44',NULL),(113,'Notificaciones de escritorio desde aplicaciones web','novedades HTML5','Haremos un repaso a la arquitectura de notificaciones push que se implementa en Android en iOS y una introducción a las notificaciones push de escritorio desde aplicaciones web HTML5 (interfaz Notification de la API Notifications).\r\n\r\nLa introducción estará guiada por ejemplos básicos en los que se deje ver ejemplos de uso.',0,2,'','','es','',3,7,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-27 19:15:00','2015-11-27 20:15:00',1,1,1,1,'','notificaciones-de-escritorio-desde-aplicaciones-web',4,'2015-11-01 18:44:46','2015-11-25 22:33:23','hDILMAZ-yJ026mDWmz7NSMVvMKtJlHjHsNIiqBoEMCE'),(114,'Programación funcional','Charla en la que se expliquen y se comenten algunos lenguajes que usan el paradigma funcional','Charla en la que se expliquen y se comenten algunos lenguajes que usan el paradigma funcional, ventajas y desventajas de la programación funcional y algún ejemplo.',0,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'programacion-funcional',4,'2015-11-01 19:43:21','2015-11-07 08:39:46',NULL),(115,'Las tripas de Hola Mundo Radio','Recorrido desde el software de streaming hasta el equipo de estudio','En esta charla:\r\n\r\n- Describiremos qué software hemos utilizado como generador y cliente de streaming y veremos una configuración mínima del mismo para iniciar y escuchar un streaming en directo.\r\n\r\n- Describiremos qué equipo de estudio utilizamos (mesa de mezclas, micrófonos, auriculares ...) y mostraremos su uso, dando algunas guías y consejos prácticos.',0,2,'http://radio.gul.es','','es','',5,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'las-tripas-de-hola-mundo-radio',4,'2015-11-01 22:15:55','2015-11-06 16:46:14','G4OZwkZesPV2r3KdHOAYInGZWceC-XzbNGugXp3ZB5A'),(116,'Refactorización','Principios básicos de refactorización de código, por qué, para qué y algunos ejemplos','Comenzaremos desde la definición del término del libro de Martin Fowler, pasando por el por qué y para qué de esta técnica que se incluye dentro de Extreme Programming (XP). Veremos algunos ejemplos de refactorización basados en los más sencillos \"olores\" (code smells).',0,3,'','','es','',3,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'refactorizacion',4,'2015-11-01 22:32:00','2015-11-04 10:36:25','VawfOElTd1jYICAc1zMNSRr2_8rqXbSvxGyloLKi4a4'),(117,'Internet en casa. (Introducción a las redes)','¿Cómo evitar la temible llamada al operador cuando tenemos un problema en casa?','Modelo TCP/IP. Herramientas de diagnóstico y solución de problemas básicos de redes.',0,2,'','','es','',4,12,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-26 18:15:00','2015-11-26 19:45:00',1,1,0,1,'','internet-en-casa-introduccion-a-las-redes',4,'2015-11-01 23:18:47','2015-11-17 21:07:20','R1LSONSA1GoKvPxckE7nJAkuWS-5_b4KH2MBbXcKD5A'),(118,'Virtualización de redes avanzado. NFV/SDN','Nuevas tecnologías de virtualización de funciones de red y redes diseñadas por software.','Últimamente todo el mundo habla de virtualización de red, ¿pero qué es exactamente?\r\nDefinición de NFV/SDN. Qué es un orquestador de red. ',0,3,'','','es','',4,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'virtualizacion-de-redes-avanzado-nfv-sdn',4,'2015-11-01 23:27:08','2015-11-06 10:15:13','jswnSUXiFMHFMT3xWnbbVCmNYZuM0tuYnh4qWb5H9dk'),(119,'Yo no tengo fugas de memoria ¿Y tú?','Simplificando el uso de la memoria en C++','Una de las quejas frecuentes en el pasado con los lenguajes nativos (sin máquina virtual) es que la gestión de la memoria dinámica es más complicada y que la recolección de basura simplifica las cosas. Por supuesto, basta experimentar un poco con lenguajes basados en máquina virtual para comprender que su aproximación no es una panacea y para descubrir que la necesidad de escribir aplicaciones multi-hilo, simplemente empeora las cosas. En esta charla mostraré como el uso de smart pointers hace desaparecer la mayoría de los problemas de fuga de memoria. Además daré algunos consejos prácticos que harán desaparecer la mayoría de problemas que puedas tener en el uso de punteros.\r\n\r\n¡A mi me funciona!. Espero que vosotros también os puedan ayudar.',0,3,'','','es','',3,11,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2015-11-24 16:00:00','2015-11-24 17:00:00',1,1,0,1,'','yo-no-tengo-fugas-de-memoria-y-tu',4,'2015-11-03 14:25:48','2015-11-17 21:04:46','JpYQQAYXzZOQMxgGHBSq-C8Jx_EnNu-I-D6CKXpHD3o'),(120,'La herencia es la clase base de todos los problemas','Polimorfismo estático mejor que polimorfismo dinámico','En esta charla pretendo provocar la reflexión. ¿Por qué llegamos a la orientación a objetos? ¿Qué problemas conseguimos resolver? ¿Qué problemas nuevos estamos generando? ¿Existen alternativas? Presentaré una revisión crítica de algunas ideas y finalizaré presentando ideas alternativas de la cómo se pueden afrontar problemas de diseño. Concluiré presentando ejemplos de código C++ con distintas alternativas para resolver un problema sencillo.',0,3,'','','es','',3,3,'','',NULL,'','',NULL,NULL,1,1,0,0,'','la-herencia-es-la-clase-base-de-todos-los-problemas',4,'2015-11-03 14:27:03','2015-11-11 12:27:05','YjwqxSBJbzEo-hNLrvGGOlFSFMj00yPjXpCSaOx9AKI'),(121,'Pruebas unitarias y análisis de cobertura','Google Test + gcov + CMake','Esta pretende ser una charla muy práctica combinando tres herramientas open source disponibles en cualquier máquina Linux. Google Test es una biblioteca para hacer muy sencillo la generación de pruebas unitarias en nuestras aplicaciones. Presentaré como se pueden escribir pruebas unitarias de una forma muy simple. CMake es una herramienta para especificar el proceso de construcción de forma muy sencilla y totalmente portable. En Linux, al final generamos Makefiles a partir de CMake. Me centraré en contar como podemos integrar GoogleTest con CMake para compilar y ejecutar las pruebas unitarias. Por último gcov es una herramienta de análisis de cobertura. Combinado con lcov, permite generar informes eficaces de la cobertura de las pruebas unitaras. Combinando estas tres herramientas se puede tener un proceso sencillo y potente para gestionar las pruebas unitaras de una aplicación.\r\n\r\nEsta charla tendrá formato taller e iré mostrando ejemplos sobre los que se podrá jugar y probar.',1,3,'','','es','',3,3,'','',NULL,'','',NULL,NULL,1,1,0,0,'','pruebas-unitarias-y-analisis-de-cobertura',4,'2015-11-03 14:28:06','2015-11-06 16:46:16','5YcGP7iAQ6mvNOw5UELjfoZx9sSd06zvOzizSTD0uHw'),(122,'Docker esto Docker aquello','¡¿Pero qué es Docker?!','Mi inexperta mente no alcanza a entender qué es Docker, para qué y cómo se usa. ¿Acaso no es lo mismo que usar una máquina virtual y ya está? ',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'docker-esto-docker-aquello',5,'2016-02-25 20:14:39','2016-03-14 09:45:40',NULL),(123,'Gimme some node!','Oh gimme gimme some noooode!','Estás a dos pasos de ser el más hipster de Internet: tan solo te falta un dominio .io y pilotar de node.js \r\n\r\nSolucionémoslo con esta charla.',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'gimme-some-node',5,'2016-02-25 20:21:58','2016-02-25 20:21:58',NULL),(124,'Pues me haré mi propio bot de Telegram','Con casinos.','¿Sabes que puedes usar Telegram para hacer cosas útiles, interesantes y frikis? Cosas como encender la calefacción, reiniciar el router o vender cosas por Internet. ¿Quieres saber cómo? Yago te lo explica :) ',0,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'pues-me-hare-mi-propio-bot-de-telegram',5,'2016-02-25 20:45:13','2016-03-18 21:57:35',NULL),(125,'1, 2, 3, API REST','APIRESTÍZATE!!','Se ha puesto de moda eso de \"PERO USA UNA API REST!!!\" y claro, eso está bien para los que saben qué se cocina y se come una cosa de esas, pero claro, luego vienen las preguntas incómodas, como:\r\n\r\n- ¿Para qué sirve una API REST?\r\n- ¿Y cómo hago una API REST?\r\n- ¿Pero cómo uso una API REST?\r\n- ¿Hay API\'s REST libres por el mundo?\r\n- ¿Quién es usted y cómo ha entrado en mi casa?\r\n\r\nEn esta época moderna es un conocimiento que siempre viene bien.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'1-2-3-api-rest',5,'2016-02-25 20:57:15','2016-03-14 09:45:38',NULL),(126,'They\'re taking the hobbits to Isengard!','Es una cota de Mithril, ¡Mithril js!','Venga va, otro framework JS más para la lista, que no sobran. ¿Qué tiene este de especial y diferente al resto? Seguramente nada, pero hay que reconocer que el nombre mola. Vale, sí, también tiene algunas otras cosas interesantes:\r\n\r\n- Ligero\r\n- Programación por componentes\r\n- Su nombre\r\n- Plantillas\r\n- DOM virtual\r\n- ¿He dicho ya que me gusta mucho su nombre?\r\n\r\n¿No sabes Javascript o no se te da muy bien? ¡Da igual! Veremos conceptos básicos y la API de Mithril, que es bastante molona y con una curva de aprendizaje pequeña. ¡Imagina lo *fácil* que tiene que ser como para que alguien que suele trabajar más con *backend* dé una charla sobre ello!\r\n\r\n> Spoiler alert: esta charla contiene diapositivas, GIFs, imágenes de gatitos (no confirmado), ejemplos de código, más GIFs y... ¿¡una sorpresa final!?',0,2,'','','es','¡Si llueve o Juan toca el piano no soy rubio!',2,8,'','',NULL,'Leganés','7.1.J03','2016-04-15 16:00:00','2016-04-15 17:00:00',1,1,0,1,'','they-re-taking-the-hobbits-to-isengard',5,'2016-02-25 22:43:08','2016-03-30 10:23:34','vjUbhAgzX3zdQrCLS6GzwDoLs2RFEuKQGfLyUbd5Ylc'),(127,'Hackea la NASA en 5 minutos','Todos sabemos que la NASA no tiene ningún sistema de seguridad y que cualquiera puede acceder a sus datos. Hagamoslo. En 5min.','Hackeemos la querida y temida NASA todos juntos en sólo 5 minutos. Esto debe ser un taller y no una charla porque toda persona que se presente a la charla debe ser capaz de hackear la NASA en como máximo 300 segundos. ¿Alguien acepta el desafío?',1,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'hackea-la-nasa-en-5-minutos',5,'2016-02-26 17:18:15','2016-03-18 21:57:56',NULL),(128,'Introducción al scrapping','Introducción al scrapping','Con esta charla se explicaría de manera muy práctica técnicas de scrapping con ejemplos generados durante el tiempo que disponga el ponente.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-al-scrapping',5,'2016-02-26 21:45:06','2016-03-14 09:45:36',NULL),(129,'Gimp Quickies!','Aprende lo básico en Gimp','GIMP es un potente software de tratamiento digital de imágenes, y además es libre y gratuito, lo que nos hace soñar con unicornios!\r\n\r\nSin embargo, la primera impresión que recibimos al abrir el programa puede llegar a ser algo intimidante. No os preocupéis, os enseñaré lo básico para que vuestra primera cita con GIMP sea amor a primera vista.\r\n\r\n---\r\n\r\n* Software Requerido:\r\n\r\nGIMP (ver. 2.8.16)\r\nDescárgalo en: https://www.gimp.org/\r\n\r\n* Recursos:\r\n\r\nAstronomy Picture of the Day by NASA\r\nhttp://apod.nasa.gov/apod/astropix.html\r\n\r\nOpenPhoto\r\nhttp://openphoto.net/\r\n\r\nGoogle Fonts\r\nhttps://www.google.com/fonts',1,1,'','','es','\r\n',4,12,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-13 16:00:00','2016-04-13 18:00:00',1,1,0,1,'','gimp-quickies',5,'2016-02-27 19:00:05','2016-03-30 10:25:05','SsnJ2QE8LVepnlORU0zOEnddWowEOTrrh8DIknxtgOI'),(130,'How to use web languages to build cross-platform apps','Building a Chrome app and porting it to desktop (NWJS) and mobile (Mobile Chrome Apps)','In this talk we will see how to build something with web languages that works on every major platform: Windows, Mac, Linux (32 & 64), Android, iOS and Chrome OS.\r\n\r\nWe will also see how to share most of the code and how to go native on Android and iOS (with Web Development Kit and JS2ObjC) if embedded web is not enough.',0,3,'','','en','I can speak on Spanish or English',3,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'how-to-use-web-languages-to-build-cross-platform-apps',5,'2016-02-28 21:11:59','2016-03-16 10:48:36','HyiyHqqhLxMPU8nfFlL72j_lD5NJ50J4Me22pVt_CWw'),(131,'Introducción a Rust','Conceptos básicos del lenguaje','Rust es el nuevo lenguaje de programación para sistemas desarrollado por Mozilla, y tiene muy buena pinta. Con esta charla se podrían dar a conocer concepots básicos de la programación en este lenguaje.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-rust',5,'2016-03-04 10:30:43','2016-03-14 09:45:32',NULL),(132,'NodeOS','Sistema operativo ligero basado en Node.js','NodeOS es un sistema operativo minimalista basado en Linux y usando Node.js como espacio de usuario principalmente orientado a servidores en la nube, pero también puede ser usado en sistemas embebidos y en el futuro como sistema de escritorio.',0,3,'','https://github.com/nodeos/nodeos','es','',2,5,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-12 16:00:00','2016-04-12 17:00:00',1,1,0,1,'','nodeos',5,'2016-03-05 13:22:58','2016-03-30 10:25:13','TWpQZQDPUtNY_OQjtGryAzrkMZ8ei6AYeFCm8Rl91nA'),(133,'An Evening with Zoe','Hagamos algo chulo con Zoe. ','Zoe mola. Puedes extenderla como quieras y usando el lenguaje que te dé la gana. Así que hagamos algo chulo con ella. En una Raspberry pi. Con casinos. ',0,5,'','','es','',3,9,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-13 18:00:00','2016-04-13 19:00:00',1,1,0,1,'','an-evening-with-zoe',5,'2016-03-05 15:08:11','2016-03-30 10:25:23','9xSR1MAvOERIFBEwEjNPJa6hoGZoPbBAtGr3FoNq7C8'),(134,'Pretend that you\'re Hercule Poirot','LaTeX es mejor que Word incluso en los errores.','Charla/Taller sobre LaTeX, qué es, porqué mola tanto, cómo funciona y ejemplos varios de cosas que se pueden hacer.\r\nDesde documentos de texto, pasando por gráficas, diapositivas... Y con el dinero que te ahorras de las licencias de Word te compras barcos.\r\n\r\nSi algún alma aventurera se quiere llevar ordenador, no hay problema, aunque mejor con Linux.',0,1,'https://github.com/Patataman/LaTeXIsBetter','https://github.com/Patataman/LaTeXIsBetter','es','',3,6,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-11 18:00:00','2016-04-11 19:00:00',1,1,0,1,'','pretend-that-you-re-hercule-poirot',5,'2016-03-06 10:11:03','2016-04-10 15:05:17','w3w8zG1qMcgrCio7PtFWTxIs2_lo0Kogs4x_bGfDI-U'),(135,'Go: Nil for null people','Go como lenguaje, Gopher como mascota.','Charla de introducción a Go, lenguaje de programación desarrollado por Google en 2009.\r\n\r\n![Gopher](https://golang.org/doc/gopher/frontpage.png)',0,2,'','','es','',2,11,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-12 17:00:00','2016-04-12 18:00:00',1,1,0,1,'','go-nil-for-null-people',5,'2016-03-06 11:21:05','2016-03-30 10:25:54','C4zTfpqRhDEE75wfhD21GY6mwT8cTKYgIpujXeBleHM'),(136,'Ya está bien de perder los cambios de tus practicas: Git al rescate','Una introducción al control de versiones con Git y al paradigma de Git-flow','En esta charla veremos una introducción de Git con algunos ejemplos interactivos. Después hablaremos del paradigma de trabajo Git-flow y comentaremos las principales herramientas con las que facilitar este trabajo. Además, durante la charla intentaremos ver por qué Git puede ser útil no solo de cara a las prácticas si no en nuestro día a día.',0,1,'','','es','',3,11,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-11 16:00:00','2016-04-11 18:00:00',1,1,0,1,'','ya-esta-bien-de-perder-los-cambios-de-tus-practicas-git-al-rescate',5,'2016-03-06 18:56:15','2016-03-30 10:25:59','CiDMRHty1dHnpKMyzxVVYxJp0YrvVkcw7t1fRSzFHTg'),(137,'Another Hacker bites the dust','Introducción a la seguridad informática','Ciberterrorismo, mafias rusas, Zeus, Stuxnet, Anonymous...... Si crees que Zeus es un Dios Griego, stuxnet un insecto o que Anonymous es un modo de tu navegador web, esta charla va esta dedicada a ti. Atrévete a adentrarte en el mundo de la seguridad informática del siglo XXI y aprende como los profesionales de la seguridad defendemos en el día a día a millones de usuarios incautos ante los peligros de la red. \r\n\r\nHaremos un repaso rápido sobre las temáticas que gobiernan el mundillo, desde los principios más básicos en los que se fundamenta, pasando por la gestión de riesgos de seguridad, cumplimiento de normativas legales, como se establecen planes de continuidad de negocio y recuperación ante desastres, seguridad física y lógica, criptografia, auditorías de seguridad y controles de acceso a la información. ',0,1,'','','es','Trayectoria profesional del ponente : https://es.linkedin.com/in/adriandominguezmartin\r\nEl contenido de la charla es un resumen de contenidos de la certificación CISSP - https://www.isc2.org/cissp/default.aspx',4,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'another-hacker-bites-the-dust',5,'2016-03-07 17:10:27','2016-03-15 22:21:17','nlYkv7-Zy_y33susrivNwojO5TlS7zxrbCbLD02Zj1w'),(138,'Con las serpientes SÍ se juega','Una introducción a Pygame','El desarrollo de videojuegos amateur lleva unos cuantos años viviendo su momento más dulce: cada vez tenemos más herramientas gratuitas y los medios para formarnos están más a nuestro alcance que nunca. Sin embargo, los novatos en la materia tendemos a ser ambiciosos y no es raro que alguna vez pensemos en empezar construyendo la casa por el tejado haciendo uso de motores complejos como Unity o Unreal Engine. Para algo los hacen de libre acceso, ¿no?  \r\n\r\nSi eres un programador con conocimientos de Python y tu estilo se asemeja más a ir sumando pequeñas victorias sobre grandes frustraciones, quizá te interese conocer Pygame. En esta charla aprenderemos algunos conceptos recurrentes de los videojuegos en 2D, al tiempo que exploramos, sin profundizar, algunos de los módulos de esta popular librería multimedia. Una introducción para novatos, de parte de una novata.\r\n',0,1,'','https://github.com/skeleborg/charla-pygame','es','',0,9,'','',NULL,'Leganés','7.1.J03','2016-04-15 17:00:00','2016-04-15 19:00:00',1,1,0,1,'','con-las-serpientes-si-se-juega',5,'2016-03-09 10:00:54','2016-03-30 10:24:13','zr8h6hjs7zWvE_dnjiaxqF5wPxGSVUGFSJR6YFyQtkU'),(139,'Internet Of Things','Cosas pequeñas que se conectan a Internet y hacen cosas divertidas','IoT se refiere a cacharritos pequeños y graciosos que se conectan unos con otros y hacen cosas y a veces pitan y se queman. Entonces vienes, buscas el aparatito roto, lo sustituyes por otro nuevo y le das a reset, y todo vuelve a funcionar y el mundo vuelve a brillar en su precioso azul palo. A veces no hace falta cambiarlo entero, puedes arreglarlo con cinta americana o goma de borrar, pero depende. Una vez arreglé un sensor de presencia con el palo de un chupachups y una cacatúa. En esta charla os contaré esa historia y quizá otras, como aquella vez que me crucé Australia de lado a lado en globo peleando a puñetazos con un barón alemán y su rabioso hurón de dos cabezas. ',0,5,'','','es','',3,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'internet-of-things',5,'2016-03-09 18:42:37','2016-03-14 10:13:02','6C9ptLx8BJqB7MD1TwqEZm5xdt5vB1rpiMd-xSOCUNk'),(140,'BLENDER','Diseño en 3D de calidad sin necesidad de pagar por la licencia de AUTOCAD','Como diseñar en 3D sin necesidad de pagar licencia de AUTOCAD, utilizando un buen programa como BLENDER y usando las respectivas Bibliotecas de OPENGL.',0,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'blender',5,'2016-03-10 14:04:38','2016-03-16 12:49:46',NULL),(141,'Desarrollo web express con Grails 3','Aprendiendo a crear una aplicación web en tiempo record','Usando el framework libre Grails, se propone la realización de una aplicación web totalmente funcional desde 0, hasta la creación de su war para ser desplegado en producción. Aplicando y configurando plugins como el de Spring Security Core para la securización, y otros interesantes, pero sobre todo focalizado en saber resolver un futuro desarrollo con otros plugins que sean necesarios.\r\n\r\nPara no perder el tiempo en cosas que se coman parte del taller, sería recomendable que todos los asistentes acudan con:\r\n\r\n- Java 8 instalado, confirmando que ejecute en la terminal\r\n\r\n- Sdkman instalado (http://sdkman.io/)\r\n\r\n- Una vez instalado ejecutar el comando sdk install grails (esto descarga la ultima versión y ocupa 100mb aprox)\r\n\r\nOpcional:\r\n\r\n- Base de datos local MySQL\r\n\r\n- IDE de desarrollo, recomendado Intellij IDEA (existe una versión de prueba gratuita de 30 días, así como una versión comunitaria libre con licencia Apache)\r\n\r\nNo se dedicará tiempo del taller a la instalación dicho software :)',1,3,'','','es','',5,6,'','',NULL,'Leganés','Sótano Biblioteca Rey Pastor','2016-04-14 17:00:00','2016-04-14 19:00:00',1,1,0,1,'','desarrollo-web-express-con-grails-3',5,'2016-03-13 17:06:24','2016-03-30 10:26:05','jwP5us_SFjHwLB6C55NSnWx0Vaq8nXwN69ZgIgDtXAM'),(142,'BLENDER','Diseño en 3D de calidad sin necesidad de pagar por la licencia de AUTOCAD','Como diseñar en 3D sin necesidad de pagar licencia de AUTOCAD, utilizando un buen programa como BLENDER y usando las respectivas Bibliotecas de OPENGL.',0,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'blender',6,'2016-10-25 02:12:15','2016-11-02 23:30:21',NULL),(143,'Docker','¿Cómo se usa Docker?','Charla/taller sobre la solución de software libre de contenedores. Cómo se usa, herramientas disponibles, y dónde/cómo poder seguir aprendiendo más.',0,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'docker',6,'2016-10-25 06:19:35','2016-11-02 14:42:03',NULL),(144,'Bueno vale pues hagamos algo de IoT','Si sale algo pues bien, y si no pues que vengan los hackers y lo usen para hacer DDoS','Nadie me dijo que las cosas acabarían así, de repente, sin apenas tiempo para reaccionar, y mucho menos para aceptarlo. Nunca podré olvidar al hombre que me cambió la vida, con su mirada fría e inteligente y su media sonrisa desconcertante. Ese hombre de tan malvada inteligencia, ese maldito ser endemoniado, esa criatura traída de las tinieblas por el mismísimo Satán. Nunca supe cómo se llamaba, mas conservo en mi memoria el sobrenombre con el que todos en aquella sala le conocían: el Barón. Su apodo recorrió la estancia de boca en boca como un fantasma hambriento que segaba paso a paso las almas de los presentes a su paso. Traía consigo una maleta que, según comentaban, le había acompañado en su viaje que duraba ya más de dos décadas, y su inseparable mascota, abominable, demoníaca y atroz, ese rabioso hurón de dos cabezas, sediento de una venganza tan humana que resultaba imposible distinguir en la penumbra quién de los dos era el dueño de quién.',1,0,'','','es','',6,4,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','bueno-vale-pues-hagamos-algo-de-iot',6,'2016-10-25 22:01:16','2016-11-04 08:43:46','BIh8spkYTmOMTe_6vlqmsqcl6NrtYPiyPgruw9NMpTk'),(145,'Programación funcional en Haskell','Introducción a la programación funcional usando Haskell','Una pequeña charla que introduce la programación funcional y la compara con el paradigma de programación de lenguajes mucho más comunes como Java o Python. Orientada a personas que ya saben algo de programación con estos últimos lenguajes.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'programacion-funcional-en-haskell',6,'2016-10-26 19:44:22','2016-11-01 23:25:17',NULL),(146,'Ruby on Rails for dummies','RoR tiene su gracia','Charla introductoria a Ruby on Rails, con énfasis en la organización de un proyecto sencillo y cómo poder participar en proyectos que usen esta plataforma.',0,0,NULL,NULL,NULL,NULL,0,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'ruby-on-rails-for-dummies',6,'2016-10-27 10:23:50','2016-11-02 23:30:24',NULL),(147,'Aplicaciones con GUI en Python','Diseño de aplicaciones con interfaz gráfica','Para aprender cómo hacer una aplicación con interfaz en vez de usar consola.',1,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'aplicaciones-con-gui-en-python',6,'2016-10-28 21:11:54','2016-11-02 10:46:23',NULL),(148,'Mucho más que el dilema del prisionero','Introducción y prespectiva a la Teoría de Juegos','El dilema del prisionero, influencias en negociaciones, economía mundial, tensiones politicas. La Teoría de Juegos está presente en muchos aspectos de nuestra vida sin ser del todo conscientes. En esta charla veremos una introducción a esta disciplina y una perpectiva general a los puntos más relevantes de este fascinante area de la matemática.',0,0,'','','','',0,10,'','',NULL,'Leganés','3.1.S.08','2016-11-17 19:00:00','2016-11-17 20:00:00',1,1,0,1,'','mucho-mas-que-el-dilema-del-prisionero',6,'2016-10-29 15:11:56','2016-11-07 16:41:31',''),(149,'Linux para todos','Sientete como en /home','¿Viniste a la charla de la Semana de Asociaciones de Linux y sigues sin amar la consola? ¿Te la perdiste y quieres tener la oportunidad de sentir su atracción? No dudes más y ven a nuestra charla 2.0 sobre Linux, donde repasaremos los conceptos generales e intentaremos profundizar más en comandos útiles de la consola y en scripting. No pruebes tus prácticas a mano, ¡eso pertenece al siglo pasado!\r\n\r\n**Nota**: La descripción anterior debe leerse con voz de teletienda. ',1,0,NULL,NULL,NULL,NULL,0,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'linux-para-todos',6,'2016-10-29 16:21:36','2016-11-01 16:59:10',NULL),(150,'Docker as development enviroment','Virtualiza tu entorno de desarrollo y llevatelo a tu ballena favorita.','Ojalá existiese una forma de llevarte todo tu entorno de desarrollo a cualquier maquina de forma facil y eficiente...',0,3,'','','es','',2,9,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'docker-as-development-enviroment',6,'2016-10-29 16:30:37','2016-11-02 23:25:04','p1ePSIfw5razRnVZ0nsqIYBkJFRSCp3wDuw1hENOGto'),(151,'El mejor lenguaje del mundo','Aprendamos a hacer lenguajes','Si quieres aprender cómo se fabrica un lenguaje, un compilador, un DSL o una máquina virtual, esto te interesa. ',0,5,'','','es','',3,6,'','',NULL,'Leganés','3.1.S.08','2016-11-15 19:00:00','2016-11-15 21:00:00',1,1,0,1,'','el-mejor-lenguaje-del-mundo',6,'2016-10-29 19:07:09','2016-11-07 16:40:41','m1vyp_Gi-6LZDTSmIKs3cOr9ogqrMJyLxMwD38Obka8'),(152,'Scala para Valientes y Auténticos','Solo los virtuosos podrán enfrentarse a Scala','La programación funcional mola, y con Scala todavía más. ',0,5,'','','es','',3,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'scala-para-valientes-y-autenticos',6,'2016-10-29 19:31:25','2016-11-01 23:25:13','6JEqf-LaLm_wz4kPkfohtwOvHxBM_KcTIzUR03RzcaY'),(153,'SCRUM! De la teoría a la práctica','Somos ágiles','Todos trabajamos en equipo, todos trabajamos bajo una metodología y desde hace cinco años ¡todos somos ágiles! Es un orgullo decir que hacemos dailys, que dividimos el desarrollo en sprints, que el cliente ve la entrega de valor periódicamente. Pero ¿tenemos todos clara la teoría? ¿se aplica igual en todas las organizaciones? ¿debemos ser esclavos de la metodología?\r\n\r\nBajo la (corta) experiencia de haber participado en proyectos gestionados bajo metodologías ágiles, daré un repaso por los conceptos fundamentales de SCRUM, cómo lo asumen las organizaciones y los agujeros actualmente abiertos.\r\n\r\nIntentaré no usar pos-its.',0,2,'','','es','',3,3,'','',NULL,'Leganés','3.1.S.08','2016-11-14 19:00:00','2016-11-14 20:00:00',1,1,0,1,'','scrum-de-la-teoria-a-la-practica',6,'2016-10-30 13:39:46','2016-11-07 16:31:35','nb9wijOLL3ADOkd3GWKiNFbOHurwsmklPSEruPt4cM0'),(154,'Notificaciones push & web','No te pierdas nada','Veremos qué son, para qué sirven y cómo se utilizan las notificaciones push y las notificaciones web. Hablaremos de GCM, APN y Event Source. Y sobre todo, demostraremos su funcionamiento con un ejemplo práctico.',0,3,'','','es','',4,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'notificaciones-push-web',6,'2016-10-30 14:54:19','2016-11-01 09:10:56','QvxZTyuxue9GOJefDp6QBocZWe6i_M1w7sxQMJeH7RA'),(155,'La serpiente que quería sumar','Conoce las librerías matemáticas más hipsters de python','En esta charla haremos una introducción a varias librerías matemáticas de python, tanto enfocadas al cálculo como a las gráficas y la muestra de datos. Veremos tambien un breve repaso a algunas librerías basadas en estas pensadas para machine learning o data science.',0,2,'','','es','',0,6,'','',NULL,'Leganés','3.1.S.08','2016-11-16 19:00:00','2016-11-16 20:00:00',1,1,0,1,'','la-serpiente-que-queria-sumar',6,'2016-10-30 19:40:56','2016-11-07 16:41:25','V5sJnZbUpEAJCqEwYvgCOpeJixb0WdH2lB35x_srSEA'),(156,'Espiando procesos en Linux ','Ténicas de debugeo de procesos en Linux','En muchas ocasiones nos encontramos que nuestro programa no funciona como esperábamos \r\nʕノ•ᴥ•ʔノ ︵ ┻━┻\r\n\r\nA veces el consumo de CPU es demasiado alto. En otras ocasiones no obtenemos una respuesta esperada por la red. Quizás los logs no se escriben donde debieran... o peor aún, el proceso parece estar parado sin motivo aparente.\r\n\r\nEn esta charla veremos, con ejemplos prácticos, algunas de las herramientas que empecé a usar (este verano yayyy!) para investigar nuestros programas.\r\n\r\nAunque pueda parecer que sólo tiene aplicación en el mundo de sistemas o de bajo nivel, veremos cómo esto es súper útil (y apasionante!!! :D) en lenguajes de (muy?) alto nivel (en mi caso, Ruby) y en situaciones en las que todos nos encontramos como programadores :)',0,3,'','','es','Las diapositivas probablemente sean en inglés, aunque si viene mejor hacer cualquier cosa en otro idioma, sin problema :)',1,7,'','',NULL,'Leganés','3.1.S.08','2016-11-16 18:00:00','2016-11-16 19:00:00',1,1,0,1,'','espiando-procesos-en-linux',6,'2016-10-30 19:59:15','2016-11-07 16:40:47','maS5E37nCYRX1LHn0k4MCdXjtl56s23LfdrgScZOwEA'),(157,'CRAKEA la ROM y actualiza tu ANDROID','CRAKEA la ROM de tu móvil y actualiza tu ANDROID ( o, si lo prefieres, instálale FirefoxOS )',' ¿ Tu móvil va cada vez más lento?,\r\n¿ y si pruebas a cambiarle la instalación que tiene de Android por defecto?.\r\nPodrías actualizar Android,\r\ne incluso,\r\nponerle un Sistema Operativo más ligero ( cómo FirefoxOS, basado en HTML5 ) ',1,0,'','','','',0,8,'','',NULL,'Leganés','3.1.S.08','2016-11-18 19:00:00','2016-11-18 20:00:00',1,1,0,1,'','crakea-la-rom-y-actualiza-tu-android',6,'2016-10-31 01:03:39','2016-11-07 16:40:54',''),(158,'Blender','No podía falta un buen taller de Blender','Ya es un taller clásico de las jornadas... Aunque nunca salga.\r\nSiempre está bien aprender como funciona una herramienta de modelado open source',1,0,NULL,NULL,NULL,NULL,0,14,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'blender',7,'2017-02-21 14:29:58','2017-03-13 07:30:50',NULL),(159,'Producción musical en Linux','Charla sobre las actuales opciones para generar y tratar audio en Linux, y cómo podemos usarlas para crear música','¿Eres un usuario de Linux al que alguna vez le he picado la curiosidad por crear su propia música? ¿Ya utilizas un ordenador Windows o Mac pero tienes un portátil muerto de risa y quieres probar Linux haciendo lo que te gusta? No lo dudes y pásate por esta charla. Tanto si quieres que suenen tres cosas en tu viejo netbook como si quieres montar un estudio casero basado en Linux, te vamos a explicar a grandes rasgos JACK, Audacity, LMMS (y Radium si da tiempo) para que salgas de aquí con una idea suficiente para comenzar a trastear en casa.',0,2,'','','es','',4,12,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-29 17:30:00','2017-03-29 19:00:00',1,1,0,1,'','produccion-musical-en-linux',7,'2017-02-21 15:49:09','2017-03-21 14:23:57','Ro2po_8KM-OgqGvgelAesSOUjDPmrjeAlDKyN6S2I-U'),(160,'CRAKEA la ROM y actualiza tu ANDROID','CRAKEA la ROM de tu móvil y actualiza tu ANDROID ( o, si lo prefieres, instálale FirefoxOS )','¿ Tu móvil va cada vez más lento?,\r\n¿ y si pruebas a cambiarle la instalación que tiene de Android por defecto?.\r\nPodrías actualizar Android, e incluso, ponerle un Sistema Operativo más ligero ( cómo FirefoxOS, basado en HTML5 )\r\n[\r\n¡¡ Aprovecha !!;\r\npor si te perdiste El TALLER del 18 de Noviembre de 2016\r\n]\r\n',1,0,NULL,NULL,NULL,NULL,0,9,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'crakea-la-rom-y-actualiza-tu-android',7,'2017-02-21 19:45:15','2017-03-13 07:40:17',NULL),(161,'FreeCAD: parametrízame como puedas','Taller de diseño de objetos paramétricos usando FreeCAD','FreeCAD es un programa CAD libre para el diseño de objetos y máquinas, similar al (castuzo) SolidWorks. Con FreeCAD es muy sencillo hacer objetos técnicos simples, usando formas primitivas y/o sketches. Pero también se pueden diseñar objetos ajustables o personalizables incluyendo parámetros en los diseños. \r\n\r\nEn este taller haremos una serie de ejemplos prácticos en los que aplicar el diseño paramétrico.\r\n\r\n(Se recomienda encarecidamente que los asistentes traigan portátil con FreeCAD instalado)',1,3,'','','es','',5,10,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-31 17:30:00','2017-03-31 19:30:00',1,1,0,1,'','freecad-parametrizame-como-puedas',7,'2017-02-21 20:08:47','2017-03-14 23:54:09','HSvqN-kzY_mIilqsSxs2rfvZuCUDd6DuK0uyTsd0c9M'),(162,'Cómo funciona la impresión 3D paso a paso','La impresión en 3D es una realidad cotidiana gracias a múltiples proyectos libres que la hacen posible.','La impresión en 3D es posible gracias a múltiples proyectos que la hacen posible. Haremos un pequeño recorrido por ellos y su función en a cadena, desde el diseño a la impresión.',0,2,'','','es','',3,16,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-27 19:00:00','2017-03-27 20:00:00',1,1,0,1,'','como-funciona-la-impresion-3d-paso-a-paso',7,'2017-02-21 23:00:39','2017-03-13 23:06:17','vsIBKkpMVrT58T2_Nl-G5iml3tZ2at4EGt_nZDDI61M'),(163,'Introducción a Bitcoin, Blockchain y smart contracts','Haremos un recorrido por como funciona la tecnologia Bitcoin, su blockchain y como funcionan los contratos inteligentes','Haremos un recorrido por como funciona la tecnologia Bitcoin, su blockchain y como funcionan los contratos inteligentes',0,2,'','','es','',4,9,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-bitcoin-blockchain-y-smart-contracts',7,'2017-02-21 23:04:52','2017-03-13 07:32:11','aqmcc-EjOdRnOGaYF4eyS_Z0lrlIB7VONjWJjpFCkf8'),(164,'Haciendo chatbots que te entiendan','Haremos un pequeño repaso sobre NLP y NLU y veremos la herramienta RASA','Haremos un pequeño repaso sobre procesamiento de lenguaje natural y su aproximación \"natural language understanding\" y veremos la herramienta RASA NLU',0,2,'','','es','',4,8,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'haciendo-chatbots-que-te-entiendan',7,'2017-02-21 23:07:31','2017-03-08 14:34:40','icQPx6rnigG0tlcvBC08Xm_NcG8iAawKlphyVc43Qs8'),(165,'Cómo se usan las metodologías ágiles en el mundo real','Haremos un pequeño taller de scrum y kanban','Haremos una dinámica por equipos para poder entender algunas reglas de las metodologías ágiles y cuándo trabajar con ellas.',1,2,'','','es','',5,8,'','',NULL,'Leganés','2.1.C19','2017-03-29 19:00:00','2017-03-29 20:30:00',1,1,0,1,'','como-se-usan-las-metodologias-agiles-en-el-mundo-real',7,'2017-02-21 23:14:58','2017-03-29 16:44:10','Eb-u8D5TlLcqrl7PybQs9p1q3fxP9lebVCftYyeB3jE'),(166,'Cómo funciona una nube','Veremos cómo funciona una nube y una pequeña introducción a OpenStack','Las nubes son un tipo de tecnología muy común actualmente, pero de bastante complejidad. Veremos cómo funcionan y tomaremos como ejemplo OpenStack.',0,3,'','','es','',4,6,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','como-funciona-una-nube',7,'2017-02-21 23:23:41','2017-03-13 07:37:45','8ogOKR6ErvTz58YbOUUNcRfRQzzMhqPc_s-pOuW7f_Y'),(167,'Introducción a la seguridad en informática y comunicaciones',' La seguridad informática es mucho más que virus y exploits. Daremos un repaso a lo que hay que tener en cuenta',' La seguridad informática es mucho más que virus y exploits. Daremos un repaso a todos los aspectos que hay que tener en cuenta para poder decir que algo es seguro.',0,2,'','','es','',4,14,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-la-seguridad-en-informatica-y-comunicaciones',7,'2017-02-21 23:42:56','2017-03-10 09:55:52','xjbVED7FeJI9npE7mlq0YKy5DGDyv5RIuAajvfPtyuc'),(168,'Mi primer bot de Telegram. Porque tener más spam, es posible','Programaremos un bot básico de Telegram utilizando TelegramBotAPI','Por si no lo conocías, Telegram es una aplicación de chat como Whatsapp pero mejor. Desde hace un tiempo existe un API oficial para programar tus propios bots con los que poder chatear para todo tipo de tareas, como recibir notificaciones, consultar el tiempo, llenar el chat de tu grupo de amigos de spam, conocer gente, jugar, conocer gente con la que jugar...\r\n\r\nLa API ofrece muchas facilidades y está disponible en muchos de los lenguajes más populares, por lo que en este taller vamos a aprender como usarla para crear nuestro propio bot y atormentar a nuestros amigos y familiares con él (siempre que hayamos conseguido que usen Telegram, claro)\r\n\r\nEl taller se desarrollará en python, para instalar el módulo basta con ejecutar con pip:\r\n$> pip install pyTelegramBotAPI\r\n\r\nAun que si prefieres otro lenguaje bastará con que instales la librería correspondiente ya que el uso de la API será muy similar.',1,2,'','https://github.com/DelegacionUC3M/delebot','es','',3,17,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-27 18:00:00','2017-03-27 19:00:00',1,1,0,1,'','mi-primer-bot-de-telegram-porque-tener-mas-spam-es-posible',7,'2017-02-22 00:04:29','2017-03-27 15:32:40','wvrKr0aKtoGaaLrQUH7WrIi3ZzAoUreJ6w4D73eHK9I'),(169,'Introducción a la programación funcional con Haskell','Daremos una introducción a la programación funcional usando el lenguaje Haskell.','Si alguna vez te ha picado la curiosidad por aprender un lenguaje funcional o simplemente no tienes ni idea de lo que significa pero te apetece probar algo totalmente distinto, esta charla igual te interesa.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-la-programacion-funcional-con-haskell',7,'2017-02-22 06:34:11','2017-03-12 08:38:22',NULL),(170,'Android Flavors Beyond the Basics','Esta charla es para entender qué son los Android Flavors, Build Variants y cómo utilizarlos en Jenkins','Si estás comenzando en Android como si eres ya un entendido, seguramente habrás oído hablar de lo que son los Flavors, Build Variants o el sistema de integración continua Jenkins. Si no has oído hablar nunca de ello, esta es una buena manera de entender qué son, ya que repasaremos todos estos conceptos y nos meteremos de lleno en ejemplos prácticos para ver su uso en proyectos Android reales. Si ya tienes experiencia en Android y Jenkins entonces en esta charla podrás conocer cómo se ha desarrollado este proceso en diferentes proyectos y así podremos compartir experiencia y conocimientos.',0,2,'','','es','- Los ejemplos de los proyectos estarán disponibles en github.',3,42,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-30 18:00:00','2017-03-30 19:00:00',1,1,0,1,'','android-flavors-beyond-the-basics',7,'2017-02-22 09:51:20','2017-03-13 23:09:24','mumT2anaCX77tEFdl8yX19rQBin2Erfuvudco7sTPuw'),(171,'Taller sobre Angular (v4.0)','Conceptos básicos de Angular y TypeScript','Una introducción básica a TypeScript y Angular (4.0.0 liberada la semana pasada), comparándolo brevemente con su predecesor para aquellos que ya han experimentado con la versión anterior, y explicando sus características principales (módulos, componentes, router, servicios, peticiones ajax...) para los que se quieran adentrar de primeras. Además, elaboraremos entre todos una pequeña aplicación (por lo limitado del tiempo) a lo largo del taller para poner en práctica lo aprendido.\r\n\r\nAl final, incluso podremos probar nuestra recién desarrollada aplicación con test unitarios (y si da tiempo, test de integración -e2e-).\r\n\r\nSe recomienda asistir al taller con NodeJS (v7.x) y NPM (v4.x). También se recomienda instalar previamente Angular CLI (npm install -g @angular/cli)',1,2,'','https://github.com/semagarcia/taller-angular-v4-jornadas-tecnicas-gul','es','Se recomienda que los asistentes traigan su propio portátil para poder practicar, aunque puede venir gente de oyente igualmente, pues lo importante es el conocimiento. En caso de salir seleccionada, se publicarán más adelante las instrucciones del software necesario.',5,9,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-30 19:00:00','2017-04-30 21:00:00',1,1,0,1,'','taller-sobre-angular-v4-0',7,'2017-02-22 10:17:58','2017-03-28 18:18:26','LlB8cAozqwpsgn7Jf0OaUp_rs6a3oBiKrjYFBxSQSek'),(172,'Docker as development environment','Virtualiza tu entorno de desarrollo y llévatelo a tu ballena favorita.','Ojalá existiese una forma de llevarte todo tu entorno de desarrollo a cualquier maquina de forma facil y eficiente...',0,2,'https://docs.google.com/presentation/d/10SjWoiqnurjJr2kARRVjkTwgYBLLcB1ee58MxdsnmXM/edit?usp=sharing','https://github.com/lucasmenendez/docker-as-development-environment','es','',2,12,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-28 19:30:00','2017-03-28 20:30:00',1,1,0,1,'','docker-as-development-environment',7,'2017-02-22 11:52:50','2017-03-28 17:06:11','dcDoV2BL2ukPLgRsmLKzKbWi5U7m7FreSvAo7UU6yw4'),(173,'Python para todos, y todos para Python!','Python es facil, sencillo y para toda la familia','Tengas conocimientos o no de programación, esta charla es para ti (si quieres aprender Python). La idea es en los primeros 3 cuartos del tiempo explicar Python, sintaxis, funciones, clases, entrada/salida, sentencias de control... Y al final, dar tiempo para trastear y responder las dudas que puedan surgir.\r\n\r\nPor lo tanto, es **muy recomendable tener ordenador** (también se puede a papel y lapiz, no voy a discriminar). Esto a su vez **depende del aula asignada, por lo que quizás pasa de taller a charla y no será necesario portatil** :(\r\n\r\nRespecto a lo que se va a ver, se puede encontrar todo en este [repositorio](https://github.com/Patataman/PythonBasic) de Github\r\n\r\nRecomendable también, traer Python instalado, para Unix, basta con hacer \r\n`$> apt-get install python3`\r\nPara Windows existe un instalador que podeis encontrar en el siguiente [link](https://www.python.org/downloads/release/python-360/)',1,1,'https://github.com/Patataman/PythonBasic','https://github.com/Patataman/PythonBasic','es','',4,22,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-02-27 16:30:00','2017-03-27 18:00:00',1,1,0,1,'','python-para-todos-y-todos-para-python',7,'2017-02-22 12:06:44','2017-03-13 19:36:06','3-6E34v06KCm1YK3NYwIETSeicjmj21f5oNvlONO_dQ'),(174,'Archi, Archimate y Modelado de Arquitecturas','Introducción al lenguaje de modelado gráfico Archimate a través de la herramienta de software libre Archi.','En la charla introduciré Archimate de la mano de Archi con una mirada crítica sobre la situación de la Arquitectura Empresarial y sus retos actuales.\r\n\r\nArchi (http://www.archimatetool.com) es una herramienta de modelado gráfico OSS que esta teniendo una gran aceptación en el modelado de Arquitecturas con Archimate.\r\nArchimate (http://www.opengroup.org/subjectareas/enterprise/archimate-overview) en un estandard de modelado grafico de arquitecturas gestionado actualmente por The Open Group (http://www.opengroup.org/aboutus)\r\n\r\nEntre los dos están revolucionando las formas clásicas de aproximarse al diseño y modelado de Arquitecturas tanto a nivel Empresarial como de Soluciones por ejemplo con el uso de plataforma de desarrollo colaborativo (GitHub) a traves del estandard de intercambio de modelos de Archimate (http://www.opengroup.org/subjectareas/enterprise/archimate/model-exchange-file-format)\r\n\r\n',0,2,'','','es','',3,18,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-28 18:00:00','2017-03-28 19:00:00',1,1,0,1,'','archi-archimate-y-modelado-de-arquitecturas',7,'2017-02-22 12:32:49','2017-03-16 00:44:44','lbsdprXsC6fM4z-oNW9eiBDNzud0cmNHgaVyg5o6mgg'),(175,'Introducción a la creación de videojuegos en 8 bits con Pico 8 y Lua','Taller introductorio básico a la creación de videojuegos utilizando Pico 8 como plataforma y Lua como lenguaje','Pequeño taller en el que se verán los distintos elementos necesarios para la creación de pequeños juegos en 8 bits, utilizando Pico 8 como plataforma y Lua como lenguaje de programación.\r\nSe cubrirán brevemente:\r\n- Subconjunto de instrucciones de Lua\r\n- Introducción a la plataforma\r\n- Conceptos para la creación de contenido con altas restricciones de hardware\r\n- Organización de assets\r\n- Creación de sprites\r\n- Creación de mapas\r\n- Creación de música\r\n- Programación de una o varias pequeñas demos\r\n- Herramientas para futuro desarrollo por parte de los estudiantes',1,2,'','','es','',3,7,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-la-creacion-de-videojuegos-en-8-bits-con-pico-8-y-lua',7,'2017-02-22 15:17:02','2017-03-13 07:40:17','UU4Sx40thjMvsfA06Vh0Es4qDxX3eOxMBW5JK91nGY4'),(176,'zoe.next','Learn the basics of the new Zoe','Zoe has evolved to become something between a bot, dockerized microservices and a distributed language. How does it work? ',0,5,'','http://github.com/gul-uc3m','en','',3,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'zoe-next',7,'2017-02-22 17:40:56','2017-03-10 09:56:10','x6D09FxrszFLttlCHosYtvHyWV8xZJWBjQMOysv55wc'),(177,'Introducción a Vulkan en Android','Una introducción a la librería Vulkan en Android para el desarrollo de aplicaciones con gráficos 3D','En 2016 se presentó en el Google I/O la librería Vulkan que pretende substituir a OpenGL. Sus ventajas con OpenGL son muchas, empezando con que es sumamente más rápido, está más actualizado y es multiplataforma. Esta charla será una introducción de cómo se crea una aplicación en android con Vulkan y cómo exprimir todas sus funcionalidades. ',0,3,'','','es','Conocimientos en Java(lo normal) y android(básico).',3,4,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-vulkan-en-android',7,'2017-02-22 20:07:05','2017-03-10 11:14:40','1p2IC2Z7r0D5_A3Q_JIwt6808sQeWTwpt3MiArwp4Rs'),(178,'Functional Programming with Javascript','I am going to introduce and hopefully persuade the audience of the many benefits of leveraging functional concepts in javascript','We often look for new breakthroughs in front-end development that promise to steer us away from some common troubles: poorly organized \'spaghetti code\', illegible layers of nested callbacks, incoherent control flows, etc. I could go on, these are just a few of the many characteristics of code that has grown to become an unmaintainable burden that no one wants to touch. We\'ve all seen that code and have even written some of it ourselves.\r\n\r\nSome of these new libraries and frameworks can be of great service by providing constructs that help avoid these problems (sometimes at the expense of introducing a whole new family of problems), but I want to focus our time at a more micro-level, exploring the value that can be gained if we change our programming mentality.\r\n\r\n\r\n**Format of the presentation**\r\n1. Introduction\r\n2. Why Functional Programming?\r\n3. Where does Functional Programming fit into my existing application architectures?\r\n4. Introducing Functional Programming Concepts\r\n5. Imperative vs Declarative Coding\r\n6. Pure Functions & Immutability\r\n7. Code Reuse & Functional Composition\r\n8. Type Safety with Containers\r\n9. Incrementally incorporating functional programming into existing applications.\r\n10. An approach for learning Functional Programming\r\n',0,2,'','','en','',3,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'functional-programming-with-javascript',7,'2017-02-23 11:06:58','2017-03-06 12:39:40','r2PBrvJ-rdcLXfNsOKcGytEkPUjgnI-21zOyTUFcXpQ'),(179,'La Singularidad, ¿A qué debemos temer? ','¿Qué es la singularidad? Si una IA es más inteligente que nosotros, ¿Tememos a los creadores, o a la IA?','Isaac Asimov en 1942 propuso 3 leyes sobre la robótica:\r\n\r\n 1. Un robot bajo ningún concepto debe dañar a un humano. \r\n 2. Un robot debe obedecer siempre las ordenes de los humanos, siempre que no interfiera con la ley anterior.\r\n 3. Un robot protegerá su propia existencia, siempre que no interfiera con las leyes anteriores. \r\n\r\nSi el ser humano crease una inteligencia artificial capaz de mejorarse a si misma sin ayuda del ser humano, ¿podría ser capaz de saltarse estas 3 leyes?  John von Neumann utilizó por primera vez el término de \"singularidad\" para referirse a este fenómeno.\r\nSi este momento llega en algún momento, ¿debemos temer que esa Inteligencia Artificial nos haga daño, o debemos temer a quién la ha creado, por crear algo más inteligente que nosotros?',0,2,'','','es','',3,15,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-30 17:00:00','2017-03-30 18:00:00',1,1,0,1,'','la-singularidad-a-que-debemos-temer',7,'2017-02-23 13:40:05','2017-03-13 19:34:19','UvW4v0ZIobiGpSUSs61CBMoNbkMr1DKNOd0GJQurN3w'),(180,'El papel de la informática en la industria pornográfica','El papel de la informática en la industria pornográfica.','Son las XXX Jornadas técnicas del Gul. Esta charla tiene que pasar el corte sí o sí.',1,0,NULL,NULL,NULL,NULL,0,9,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'el-papel-de-la-informatica-en-la-industria-pornografica',7,'2017-02-25 19:55:49','2017-03-07 10:49:52',NULL),(181,'El videojuego que quería ser libre','Charla sobre motores de videojuegos open source','Breve charla para dar a conocer distintos motores de videojuegos *open source*.\r\n\r\nSe hablará brevemente de cada uno, con el objetivo de dar a conocer su existencia y animar a la gente a que los use. Algunos que se podrán encontrar serían:\r\n\r\n* Pygame\r\n* Love\r\n* OpenBor',0,1,'','','es','',2,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'el-videojuego-que-queria-ser-libre',7,'2017-02-27 16:33:08','2017-03-06 00:32:22','R_Bem4SUxfueCJwPqXb270xTtbJuD18GhmeAJRpcs0o'),(182,'Introducción a las Progressive Web Apps','Qué son las progressive web apps, cómo podemos iniciarnos en ese mundo y qué consecuencias tendrán en el futuro.','Qué son las progressive web apps, cómo podemos iniciarnos en ese mundo y qué consecuencias tendrán en el futuro.',0,0,NULL,NULL,NULL,NULL,0,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-las-progressive-web-apps',7,'2017-02-27 20:39:49','2017-03-07 16:39:25',NULL),(183,'Los datos son el pode R','Introducción al lenguaje R y sus aplicaciones','Hoy en día el manejo de datos es muy importante en cualquier área, ya sea para sacar estadísticas, obtener información derivada o aplicar técnicas de aprendizaje automático.\r\n\r\nEn este taller se aprenderá a usar las principales funciones del lenguaje y como aplicarlas en problemas reales o potencialmente reales.',1,0,NULL,NULL,NULL,NULL,0,8,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'los-datos-son-el-pode-r',7,'2017-02-27 23:26:20','2017-03-09 08:45:18',NULL),(184,'Por qué el Software Libre es importante (Breve historia del GUL)','Como nació, que principios nos han movido y donde estamos','El gul nació de un pequeño grupo de personas con curiosidad cuando Linux se consideraba un juguete de freakies. Las licencias libres eran utopías de hippies sin futuro. Hoy Linux es omnipresente, de android a smart TV, de entorno doméstico a amazon. Parece que todo lo interesante se puede encontrar publicado en github. Sin embargo... la realidad es más frágil de lo que parece.',0,1,'','','es','',3,7,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-31 19:30:00','2017-03-31 20:30:00',1,1,0,1,'','por-que-el-software-libre-es-importante-breve-historia-del-gul',7,'2017-03-03 08:55:09','2017-03-13 19:33:20','00C_nnl5YwvYie3HnInKNEm2o9ba5PdiCsme8a93tzA'),(185,'¡Orcos de Mongo, gritad para mí!','Taller de iniciación a MongoDB y las base de datos noSQL','MongoDB es posiblemente la base de datos noSQL más famosa, aprendamos a usarla y conquistemos la Tierra Media, por ejemplo.',1,0,'','','','',0,11,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-28 16:30:00','2017-03-28 18:00:00',1,1,0,1,'','orcos-de-mongo-gritad-para-mi',7,'2017-03-05 17:48:06','2017-03-21 14:23:30',''),(186,'No dejes que la consola de Linux te intimide','Saldrás de esta charla pensando \"¿cómo he podido vivir hasta ahora sin saber esto?\"','¿Has abierto alguna vez la consola y las has cerrado por parecer un pozo negro? ¿Siempre has pensado que esto de Linux es muy difícil y la consola es muy fea? Eso es porque no la has mirado con cariño y detalle. Tras esta charla tendrás conocimientos suficientes para realizar tus practicas, completar tus proyectos personales e incluso mandar algún que otro satélite al espacio. Si tienes suerte, incluso puede que sepas tanto como para hacer hablar a las vacas.\r\n\r\nEn esta charla repasaremos algunos comandos básicos de la consola de Linux y otros (sobre todo otros) no tan básicos. Aprende como exprimir el **máximo potencial a tu Linux**, hasta el punto de odiar entornos gráficos y querer crear carpetas desde la consola. O no, porque tú puedes. Saldrás de esta charla pensando \"como he podido vivir hasta ahora sin saber esto?\" o te devolvemos el dinero.',0,2,'http://ftp.gul.uc3m.es/pub/gul/cursos/2017/marzo/noDejesQueLaConsolaDeLinuxTeIntimide.pdf','','es','',3,26,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-29 16:30:00','2017-03-29 17:30:00',1,1,0,1,'','no-dejes-que-la-consola-de-linux-te-intimide',7,'2017-03-05 20:05:27','2017-03-29 10:51:50','CrT88-5OoqAp1cOaQ8_K287TUF6kL_6gZz_94SqNnN8'),(187,'Quédate con alguien que te mire como Wall-E','Introducción a la visión artificial','Hablaremos de las técnicas y fundamentos teóricos que forman la base de la visión artificial. Analizaremos las técnicas más usadas dentro de este campo tan cuco, y veremos cómo se traducen en un script de código. Todo esto en una hora... ¿fácil, verdad?\r\n\r\n![Wall-e](http://www.gifmania.com/Gif-Animados-Walt-Disney/Imagenes-Peliculas-Pixar/Wall-E/Wall-E-82804.gif)\r\n\r\n* 0. Dulce introducción\r\n* 1. Formación de imágenes\r\n* 2. Representación del color\r\n * 2.1 RGB: Teoría del Triestímulo\r\n* 3. Procesado de Imagen\r\n * 3.1 Transformadas (FFT, DCT, Pirámides)\r\n* 4. Descriptores visuales\r\n* 5. Estimación de Movimiento\r\n* 6. Visión Estereoscópica\r\n* 7. Disparidad binocular\r\n* 8. Photometric stereo\r\n* 9. Aplicaciones reales',0,2,'https://drive.google.com/open?id=0B5PENwkrWjd3M05ObW9NVGZhamc','','es','',3,28,'','',NULL,'Leganés','1.2.C16 - Sala Adoración de Miguel','2017-03-31 16:30:00','2017-03-31 17:30:00',1,1,0,1,'','quedate-con-alguien-que-te-mire-como-wall-e',7,'2017-03-06 00:13:59','2017-03-31 16:22:27','shWabDvK6wICu0JoXRl5dq3QmDxUcEUXzoISSJKaDbY'),(188,'Introducción a la programación funcional','Introducción a la programación funcional','Una pequeña introducción a la programación funcional: dónde surge y por qué, qué diferencias tiene con respecto a la programación secuencial que todos conocemos, y qué usos prácticos tiene.',0,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-la-programacion-funcional',8,'2017-10-22 22:33:34','2017-10-31 12:08:20',NULL),(189,'El cerebro de las IAs: Redes neuronales','Qué son las redes neuronales y cómo encajan en la inteligencia artificial','¿Qué es una red de neuronas? ¿Cómo funcionan estos novedosos (o no tan novedosos) algoritmos? ¿Dónde se enmarcan dentro de la Inteligencia artificial?\r\n\r\nDurante esta charla-taller se sentarán las bases que nos permitirán entender cómo funcionan estos algoritmos, sus ventajas y desventajas. Se intentarán desmitificar, acercándolos a los asistentes, con el objetivo de salir del taller con una red de neuronas funcional, y los conocimientos para desarrollar una propia. \r\n\r\nSera una charla-taller, ya que hablaremos  de las redes de neuronas en general y después trataremos de programar un ejemplo de red de neuronas, así que traed vuestros portátiles.',1,1,'https://docs.google.com/a/uc3m.es/presentation/d/1Zayg2Hb0-rSzTp5urklVIs7P8yBfcwWbIxi9ShvdvYI/edit?usp=sharing','https://github.com/Drimmark/NeuralNetworksBasic','es','',4,34,'','',NULL,'Leganés','7.2.J04','2017-11-23 17:30:00','2017-11-23 19:00:00',1,1,0,1,'','el-cerebro-de-las-ias-redes-neuronales',8,'2017-10-22 22:53:15','2017-11-23 00:18:37','CKSWArrfvU3oxLRz5ix0gwnxRpsSZGDFFiB8lukJQmA'),(190,'Computación cuántica.','Narración de los últimos avances en computación, y cual puede ser el futuro de esta.','Podría tratarse (si el ponente conoce del tema) cómo es el tratamiento de datos a estos niveles. ¿Por qué la computación cuántica podría destronar a la binaria?¿En qué campos puede aplicarse esta tecnología?\r\nEl tema resulta bastante misterioso desde que se habla mucho pero nadie concreta en absoluto.',0,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'computacion-cuantica',8,'2017-10-22 22:58:21','2017-11-06 20:59:08',NULL),(191,'Introducción a Vim','Introducción al editor de texto Vim','Pequeña introducción a Vim, trucos y funcionalidades básicas y prácticas para empezar a usar Vim, desde cero. \r\n',0,1,'','','es','',0,10,'','',NULL,'Leganés','1.2.C16','2017-11-22 18:00:00','2017-11-22 19:00:00',1,1,1,1,'','introduccion-a-vim',8,'2017-10-22 23:22:02','2017-11-19 14:08:08','N0NuVwKYryQXLSDcsEXq4GRaIZbVPd0I-SbOXMQIlPU'),(192,'Dios dijo: \"Hágase la luz¨, y la luz se hizo. Python dijo: \"Hágase la luz¨, y la luz se hizo en 20 líneas menos.','Y bastante más rápido. ','¿Qué tendrá ese Python para que todos hablen de él? Si quieres saberlo, estás invitado a esta charla, donde te presentaré qué se puede y qué se esta haciendo con este polivalente lenguaje open-source ahora mismo. Además, por supuesto, explicaré el uso del lenguaje: desde su bella sintaxis, hasta cómo crear una inteligencia artificial que alcance la singularidad y conquiste el universo. Bueno, puede que no de tiempo de tanto, pero intentaré exprimir la charla y avanzar lo más lejos posible :)\r\n\r\n\r\n\r\nSe recomienda traer un portátil, con el fin de sentir el poder de Python en tus propios dedos. Sería de agradecer que tuviéseis Python 3 ya instalado en vuestros portátiles: En Unix, vale con: `$> apt-get install python3`. \r\n(Si tienes Windows: pásate a Linux... o descarga Python desde la web oficial: https://www.python.org/downloads/release/python-363/)\r\n\r\n',1,2,'','','es','',5,25,'','',NULL,'Leganés','7.2.J04','2017-11-20 17:00:00','2017-11-20 19:00:00',1,1,0,1,'','dios-dijo-hagase-la-luz-y-la-luz-se-hizo-python-dijo-hagase-la-luz-y-la-luz-se-hizo-en-20-lineas-menos',8,'2017-10-23 01:03:44','2017-11-10 23:27:08','HQl-BNTLDG4a9xnP74cErtQLNnhAMqkKpwBqAMoMbFM'),(193,'La monitorización ha cambiado. Prometheus & Grafana','Una breve introdución a Grafana para la monitorización de tu sistema complementada con unas pinceladas de Prometheus','La monitorización es una de esas cosas que la gente cuando lo escucha dice: \"Claro, mi fichero de logs, ¿no?\". Con esta charla se pretende cambiar la forma de monitorizar las cosas, cambiar una filosofía de monitorización estática de un simple \"UP\" u \"OK\" para tener una serie temporal en la que debemos interpretar y de la que podemos extraer mucha más información de una pasada. \r\nIntroduciremos las tecnologías:\r\n    * Grafana: https://grafana.com\r\n    * Prometheus: https://prometheus.io/\r\nAsí como las grandes posibilidades que nos brindan estas tecnologías y su importancia en el mundo actual. ',0,1,'','','es','',3,4,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','la-monitorizacion-ha-cambiado-prometheus-grafana',8,'2017-10-23 07:14:32','2017-11-07 18:48:26','B90DgLhDzZ89NMTy2cteektaV3aGaCw9Zam-fbgzoWc'),(194,'You must construct additional pylons!','Creando un bot en Starcraft: Brood War con BWMirror','Charla donde se verá principalmente todo lo necesario para poder programar tu propio bot de Starcraft: Brood War.\r\n\r\nSi se quiere seguir en directo será necesario un portátil con Windows ( :( ) y Starcraft: Brood War en la versión 1.16.1 y vuestro entorno preferido para programar en Java o C++ (la charla será en Java).\r\n\r\nEl framework usado para el bot es Open Source, ya sea BWAPI (https://github.com/bwapi/bwapi) o BWMirror (https://github.com/vjurenka/BWMirror)',0,2,'','','es','',3,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'you-must-construct-additional-pylons',8,'2017-10-23 07:29:16','2017-11-05 16:52:23','mQZUFaIisl6_DHWEyMLoOY3Z7nhvCRo_BTYHBnB9WLM'),(195,'LaTeX basics!','Conocimientos básicos de LaTeX','Se trataría de una charla donde se diera a conocer LaTeX, y se enseñase a utilizar, al menos en los aspectos más básicos, para aquellos que tienen 0 conocimiento de LaTeX y quieren apreder a usarlo!',0,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'latex-basics',8,'2017-10-23 10:06:49','2017-11-06 14:34:27',NULL),(196,'VIMvinidos al relevo de Sublime.','Veremos el potencial de la personalización de Vim','Es dificil saber con que IDE quedarse para el día a día. Pero por qué un IDE? Un editor de texto no está a la altura?. En esta charla veremos que Vim puede ser nuestro amigo del día a día sin ningun uso de plugins.',0,3,'','','es','',0,8,'','',NULL,'Leganés','1.2.C16','2017-11-24 17:01:00','2017-11-24 18:00:00',1,1,0,1,'','vimvinidos-al-relevo-de-sublime',8,'2017-10-23 21:08:06','2017-11-10 23:41:02','2aswTCncLV2ppUGVnEdUxakviTDi0mJSIVXyPPtRhJE'),(197,'Introduccin a rubber ducky','Iniciacion a rubber ducky','Explicacion (y a poder ser demostracion) de lo que se puede hacer con ese dispositivo y el resto que incluye el paquete ',0,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'introduccin-a-rubber-ducky',8,'2017-10-23 23:09:16','2017-11-02 10:58:02',NULL),(198,'Blender para principiantes','Charla donde aprenderemos los conceptos básicos Blender y qué cosas podemos hacer con este programa.','En esta charla os enseñaré lo más básico de Blender, así que no hace falta que vengáis con conocimiento previo, ya que empezaré desde cero. Os daré algunos consejos e ideas para que podáis crear las figuras que queráis y os enseñaré a usar los comandos más básicos siguiendo la creación de una figura sencilla. Podréis preguntarme las dudas que tengáis.\r\n\r\nVale tanto Windows como Linux ya que su estructura y organización es idéntica.',0,1,'','','es','',0,20,'','',NULL,'Leganés','1.2.C16','2017-11-22 19:00:00','2017-11-22 20:00:00',1,1,0,1,'','blender-para-principiantes',8,'2017-10-24 13:54:03','2017-11-10 23:36:33','2Ocfcy1buGdZjZwjsiMID34BtcEZzud2LXT-7e4ch6k'),(199,'Tus primeros ruidos con Pure Data','Un pequeño taller con Pure Data, una herramienta libre de creación sonora y un megasintetizador modular.','Este día nos lo vamos a pasar chachi sacando ruidos desde nuestro PC, ya funcione con macOS, Linux o Windows. Pure Data es un entorno modular de \"programación gráfica\" en el que podemos meter osciladores a tutiplén y montarnos nuestro R2D2 personal o un módulo de habla de Zoe.\r\n\r\nNecesarias ganas de aprender y motivación por la materia. Recomendable saber lo que es una onda y manejarse en ello. Y mucho mejor si ya sabes algo de audio digital, aunque seguramente caiga una introducción de ello, porque es muy interesante y necesario.\r\n\r\nPodéis encontrar instaladores del programa en los links de debajo para Windows, macOS y Linux, aunque para este último mejor buscar \"puredata\" en vuestros repos.',1,2,'http://puredata.info/downloads/pure-data','','es','',3,8,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'tus-primeros-ruidos-con-pure-data',8,'2017-10-24 15:47:24','2017-11-05 16:52:21','CLqrFe5S5eOotAHEjg71jTBmnTQ3tHNnOueDN_57F6I'),(200,'Paralelización en Python: hemos sido engañados...','Descubriremos por qué la paralelización en Python no es trivial, y las posibilidades para llevarla a cabo.','Para los programadores que provienen de lenguajes de programaciones diferentes a Python, el modo en el que este lenguaje gestiona la paralelización con hilos (threads) puede resultar un tanto extraña. Existen muchos malentendidos sobre cómo llevarla a cabo de forma correcta, qué opciones existen para lograrla, y cuál es su diferencia con la concurrencia.\r\n\r\nMi objetivo es aclarar este tema y demostrar que no es tan trivial como pueda parecer a simple vista.',0,1,'https://drive.google.com/open?id=1aT3UsrW-99xXteffNC95pvkHNa2cuXUS','','es','',2,20,'','',NULL,'Leganés','1.2.C16','2017-11-23 19:00:00','2017-11-23 19:30:00',1,1,0,1,'','paralelizacion-en-python-hemos-sido-enganados',8,'2017-10-25 17:47:01','2017-11-23 21:39:53','Qs14nGayuEmLqbS768QVGihkx4Z4qHhw5tjR59ZDkmw'),(201,'Despliegue \'Full stack\' en Python: desde el Javascript, y más allá!','Explicaré como se lleva a cabo un desarrollo \'Full stack\' de una aplicación web en Python','Para desplegar una aplicación web existen muchas capas (de ahí el término \'Full Stack\') que tienen que comunicarse entre sí. Conviene conocerlas para tener una visión más completa de cómo funcionan los servidores web y las aplicaciones que allí se alojan.\r\n\r\nEn la charla explicaré la arquitectura de una aplicación web desde arriba (Nginx / Apache) hasta abajo (Javascript del cliente), y comentaré el uso de un par de paquetes Python que permiten el funcionamiento de un back-end desplegado en dicho lenguaje: \"Flask\" y \"Gunicorn\".',0,3,'https://drive.google.com/open?id=1n3nG6fGWjIWzcZWhuf1pV5x2qH0tHUu8','','es','',2,22,'','',NULL,'Leganés','1.2.C16','2017-11-23 19:30:00','2017-11-23 20:00:00',1,1,0,1,'','despliegue-full-stack-en-python-desde-el-javascript-y-mas-alla',8,'2017-10-25 18:00:28','2017-11-23 21:40:37','eGVYrfgtgnZRwWEYPTIXS9NQyaZE-O4zmyz6X_cKlx0'),(202,'De como Wannacry te amarga un viernes. Y el fin de semana. Y las siguientes semanas.....','Y parcheas. Y viene Petya Not Petya . Y luego Bad Rabbit.....','La ciberseguridad esta de moda, admitamoslo. Ha sido un año de emociones con ataques demoledores uno detrás de otro. Ninguna empresa queda libre de ello, y rara es la semana que no leemos alguna noticia referente al mismo . ¿ Pero que hay de verdad en este mundo? Oimos sobre seguridad informatica desde el burladero y no nos atrevemos en muchas ocasiones a pasar al otro lado. Atrevete a dar el paso\r\n\r\nGestiono la respuesta a incidentes en el perimetro de EMEA en un banco internacional, y mi trabajo consiste en estar un paso por delante de los atacantes día tras día, previniendo y respondiendo ante cualquier intento de intrusión en nuestras redes. Y hay muchos. Ven a pasar un rato a esta charla distendida y te contare como es ese dia a dia y que elementos usamos para defender a millones de usuarios. La mitad de la charla la pasare contando mis experiencias, y la otra mitad la podras pasar preguntando lo que te de la real gana',0,1,'','','es','',3,20,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'de-como-wannacry-te-amarga-un-viernes-y-el-fin-de-semana-y-las-siguientes-semanas',8,'2017-10-26 20:33:20','2017-11-04 19:30:28','eCdn0CpM-ETj6f77jOunTFzvcFLLiyE3ZkBcx_wbg04'),(203,'La mujer en la ingeniería','La mujer dentro de la ingeniería, el ambito científico y el de la informática.','El lugar que ocupa la mujer en el campo de la ingeniería y de la informática, es muy dificultoso. Queremos acercar la perspectiva de las mujeres que estudian estas carreras a sus compañeros para que adquieran mas concienciación, y que sean más conscientes de esta situación y no la favorezcan. Además pretendemos compartir inventos o desarrollos que hayan sido realizados por mujeres que se estudien en nuestras carreras para mostrar el gran aporte que han realizado las mujeres a el campo de la ingeniería y de la informática. Mujeres como la que da nombre a nuestra asociación Ada Lovelace, primera persona en programar.  ',0,0,'','','es','No posible el viernes 24.',4,28,'','',NULL,'Leganés','1.2.C16','2017-11-21 17:00:00','2017-11-21 18:30:00',1,1,0,1,'','la-mujer-en-la-ingenieria',8,'2017-10-26 21:21:35','2017-11-10 23:31:59','xXcINVuSTpuxjQx01IXuugo3aTte5hB8mUpBWtJKgMo'),(204,'¿Un MATLAB libre y gratuito? Introducción a Octave','Taller para aprender a usar la versión libre de Matlab (y es de GNU :) ) https://www.gnu.org/software/octave/','Octave es un programa enfocado al **análisis numérico**. En este taller cubriremos los aspectos básicos, que pueden ayudarnos a resolver problemas cuando queremos tirar por software libre y evitarnos pagar licencias.\r\n\r\n\r\n\r\n\r\n### Link de instalación: [https://www.gnu.org/software/octave/](https://www.gnu.org/software/octave/)\r\n\r\n**Paquetes interesantes:** [https://octave.sourceforge.io/packages.php](https://octave.sourceforge.io/packages.php)',1,2,'','','es','',4,13,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','un-matlab-libre-y-gratuito-introduccion-a-octave',8,'2017-10-27 08:15:08','2017-11-05 16:52:17','EWRcMpIIIciDMdA78YkJkNbDp2JrtUjNUjHjZGXWkPU'),(205,'La primera hora de tus próximos 10 años: una introducción a Emacs','Una introducción para principiantes para el editor de texto Emacs','Un famoso artículo dice que [Emacs se debe aprender en 10 años](http://tess.oconnor.cx/2009/07/learn-emacs-in-ten-years). No voy a ser yo quien lo discuta, pero en esta charla intentaremos que todo el mundo entienda las nociones básicas del editor para poder empezar a ser productivo en Emacs, y la motivación necesaria para que empecéis a hackear vuestra herramienta definitiva de productividad.\r\n\r\nRepasaremos desde movimiento básico y los conceptos principales hasta la instalación de paquetes y un uso básico de Emacs Lisp. Además, se intentará repasar los paquetes principales que se usan dentro del ecosistema para las tareas más comunes: tomar notas, git, emuladores de terminal y distintos modos de programación.',0,2,'https://github.com/DiegoVicen/gul-emacs-talk/blob/master/slides.pdf','https://github.com/DiegoVicen/gul-emacs-talk','es','',3,26,'','',NULL,'Leganés','1.2.C16','2017-11-21 19:00:00','2017-11-21 20:00:00',1,1,0,1,'','la-primera-hora-de-tus-proximos-10-anos-una-introduccion-a-emacs',8,'2017-10-27 19:56:32','2017-11-21 20:43:05','LVE3TcCdE9r9AK6tMPVIjaRn3RZeAQV5AA3E6E13uTE'),(206,'Iniciación al scripting en Bash','Automatiza tu vida Bash','Aprenderemos a crear scripts de Bash para la automatización y la realización de tareas con una charla/taller de iniciación al sistema integrado por defecto en sistemas GNU/Linux y macOS más potente de todos.',1,2,'','','es','',3,11,'','',NULL,'Leganés','7.2.J04','2017-11-24 19:00:00','2017-11-24 20:00:00',1,1,0,1,'','iniciacion-al-scripting-en-bash',8,'2017-10-28 15:16:50','2017-11-10 23:29:20','5NEIpKO6Gdf84t8uq9OXMrEaSo8msjZdTYf0TgeORBA'),(207,'Agentes de Zoe como churros','Como hacer mi primer agente de Zoe','Zoe, la asistente virtual del GUL está reconstruyéndose, e implementar un agente nuevo sólo requiere media hora. Saber lo que haces y hacerlo bien, quizá un poco más.\r\n\r\nEn este taller veremos como desarrollar un agente desde cero. ',1,0,NULL,NULL,NULL,NULL,0,6,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'agentes-de-zoe-como-churros',8,'2017-10-28 16:52:58','2017-11-02 18:01:53',NULL),(208,'Animación con software libre','Existen muy buenas herramientas libres para hacer animación, en este taller aprenderemos a usar alguna de ellas.','¿Siempre has querido hacer tu propia serie de animación? ¿Incluir cinemáticas en algún proyecto?¿Conocer más de cerca la animación?\r\nSea cual sea tu motivación (y sí, aunque tu principal problema sea que dibujas como un mono borracho) aprenderemos cómo realizar nuestras primeras animaciones con herramientas libres en una sesión salpicada de historias y memes de este mundillo.\r\n\r\n\r\nEn primer lugar, desarrollaremos los conceptos y términos fundamentales para entender esta disciplina (y para que puedas ser el mejor postureta de tu barrio si lo deseas). Esta fase de la charla se acomodará especialmente al nivel de los asistentes.\r\nDespués, hablaremos de los distintos tipos de animación y del software libre disponible para ello, así como de las herramientas principales y comunes a la mayoría de ellos y de las particularidades de cada programa.\r\n También podremos ver  el workflow general y  asomarnos a la producción real de un corto o serie, lo que nos permitirá planificar nuestros proyectos de forma coherente, así como entender y valorar más las series que vemos habitualmente.\r\nFinalmente, descubriremos algunos recursos que nos permitirán expandir nuestro conocimiento en el futuro.\r\n\r\n\r\nEsta charla está principalmente orientada a la animación 2D, ¡pero es un MUST para aquellas personas que prefieran las tres dimensiones! Los principios de animación son universales.',0,1,'https://justpaste.it/GUL','','es','',0,8,'','',NULL,'Leganés','1.2.C16','2017-11-24 18:00:00','2017-11-24 19:00:00',1,1,0,1,'','animacion-con-software-libre',8,'2017-10-28 17:05:19','2017-11-14 14:14:07','ghbcNKUY_ZvmMnL1RoIppGQvHy2UkkWWuo9kyso80Zs'),(209,'Crawlers y bots en la web para toda la familia','Implementar un crawler y un bot que rellene formularios','Los crawlers son software que se utiliza para analizar páginas web y extraer cierta información para multitud de fines, implementar uno puede parecer complicado, pero con ciertas nociones podemos diseñar uno básico, y además, como extraer información sabe a poco, también aprenderemos como implementar un bot que rellene formularios.',1,0,NULL,NULL,NULL,NULL,0,5,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'crawlers-y-bots-en-la-web-para-toda-la-familia',8,'2017-10-28 17:15:29','2017-11-06 14:34:23',NULL),(210,'Introducción a OpenGL','Como empezar a usar OpenGL','- Que es OpenGL\r\n- Como crear una aplicacion con GLFW (en Linux)\r\n- Vertex Buffer Objects, Vertex Attribute Objects \r\n- Dibujar un triángulo\r\n- Shaders GLSL\r\n- Fuentes para seguir aprendiendo\r\n\r\nOpenGL es multi plataforma y se puede utilizar con muchos lenguajes, pero en el taller se usará Linux y C++. ',1,3,'','','es','',4,13,'','',NULL,'Leganés','7.2.J04','2017-11-20 19:00:00','2017-11-20 21:00:00',1,1,0,1,'','introduccion-a-opengl',8,'2017-10-29 19:28:11','2017-11-10 23:27:47','xdVfI_8gevzQnGf-WuTTSCSai46mYYJQVMiFFpFdv8I'),(211,'¡Expresiones regulares para todos!','Aprende a usar las expresiones regulares y acabarás con ellas hasta en la GNU+Sopa','En cómputo teórico y teoría de lenguajes formales una expresión regular, también conocida como regex, regexp1​ o expresión racional,2​3​ es una secuencia de caracteres que forma un patrón de búsqueda, principalmente utilizada para la búsqueda de patrones de cadenas de caracteres u operaciones de sustituciones. ',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'expresiones-regulares-para-todos',9,'2018-03-12 08:04:13','2018-03-19 06:28:09',NULL),(212,'Zoe ha muerto, ¡Larga vida a Zoe!','Haciendo un módulo con la nueva Zoe','Aprende cómo funciona la nueva Zoe (en Python) y crea un módulo desde 0!',1,0,'','','','',0,6,'','',NULL,'Leganés','7.1.J02','2018-04-12 17:00:00','2018-04-12 19:00:00',1,1,0,1,'','zoe-ha-muerto-larga-vida-a-zoe',9,'2018-03-12 08:12:52','2018-03-31 19:18:59',''),(213,'El Ministerio de los Andares Tontos','Aprende Python, pero un Python más allá de lo básico','Por que Python es algo más que una sintaxis bonita. Aprende truquitos y descubre sus cara más oscura para que decidas si te gusta de verdad o no.',0,1,'https://drive.google.com/open?id=1m7uFIuYvQKhj7mUfC3dglWByPuKHzFK1QkIWaYyCfww','https://github.com/Patataman/PythonBasic','es','',4,8,'','',NULL,'Leganés','3.S08','2018-04-11 18:30:00','2018-04-11 20:30:00',1,1,0,1,'','el-ministerio-de-los-andares-tontos',9,'2018-03-12 08:46:01','2018-04-12 09:59:54','wGQpYez-wjAAD0e7FsXsG5vMMRqfR6q7mqbcr94ZyCI'),(214,'Castellano 101','Usando NLU para entender español','Aprenderemos a usar la librería [RASA](https://nlu.rasa.ai/) para hacer un módulo de NLU que entienda la intencionalidad de una frase. Esto es vital en la mayoría de bots para desencadenar acciones. [RASA](https://nlu.rasa.ai/) es una solución open source para resolver esta problemática. El taller se dividirá en:\r\n\r\n* **Fundamentos**: Hablaremos de los fundamentos del NLU y haremos algún ejemplo básico.\r\n* **Y ahora, en castellano**: Veremos como generar nuestro propio set de entrenamiento en castellano, con ejemplos más complejos.\r\n* **¿Y si aprendiese?**: Haremos un aprendizaje incremental, de forma que conforme converse aumentemos nuestro dataset.',1,1,'','','es','',4,4,'','',NULL,'Leganés','7.1.J02','2018-04-10 19:00:00','2018-04-10 21:00:00',1,1,0,0,'','castellano-101',9,'2018-03-12 09:02:35','2018-04-02 14:53:49','F42cFevJ2K_5-okdX_MjhEgoMtAFx5Q6uv6xEkNLWNs'),(215,'Se dice almohadilla no \"hastag\"!','Aprende C# o C-Sharp o C-Almohadilla','Aprende un lenguaje muy utilizado en scripting, que se ha extendido gracias a Unity.',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'se-dice-almohadilla-no-hastag',9,'2018-03-12 09:11:30','2018-03-19 06:28:03',NULL),(216,'Si te gustan los trenes, Ruby on Rails','Ruby on Rails es un framework para crear aplicaciones web','Aprende Ruby on Rails, crea tus aplicaciones web en código abierto y te llevarás de forma totalmente gratuita un puesto de técnico en RoR para mantener la aplicación de cursos de GUL UC3M! (Ver condiciones en el despacho)',1,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'si-te-gustan-los-trenes-ruby-on-rails',9,'2018-03-12 09:18:25','2018-03-20 13:50:13',NULL),(217,'Go Go Golang','Toma de contacto con Go y su magnífica libreria estandar','Veremos el magnifico potencial que tiene la libreria estandar de este reciente lenguaje. Crearemos en pocos pasos y sin dificultad una APIRest para nuestro uso.',1,3,'','','es','',4,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'go-go-golang',9,'2018-03-12 14:33:36','2018-03-23 17:40:37','uPkOznrLgsREkrKMIKu1TeEdlh3-bBIZflR7ZqR4FI0'),(218,'Lua para scripting','Scripting en Lua y la interacción con servicios','Lua es un lenguaje muy práctico para scripting que se puede usar incluso dentro de otros programas, tales como juegos.\r\n\r\nEsta charla serviría como introducción al lenguaje y posibles casos de uso.',0,0,NULL,NULL,NULL,NULL,0,2,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'lua-para-scripting',9,'2018-03-12 16:20:46','2018-03-23 17:41:25',NULL),(219,'¡La neurociencia será Open o no será!','If you want reproducible science, the software needs to be Open Source.','Quién le iba a decir a Ramón y Cajal que interactuaríamos en 3D con las neuronas (esas pelusillas con muchos brazos) que él dibujaba con tanto afán. \r\nY quién nos iba a decir a nosotros que dentro de x años estaríamos en ese episodio de Black Mirror. \r\nEsos x años dependen, entre otros tantos factores, de cómo sea nuestra red (neuronal y no tan neuronal) de conocimiento compartido en esto de lo que tanto hablan ahora: neurociencia.\r\nNos daremos un paseo por el universo 3D que circula de forma muy Open y crearemos hype ante las expectativas que se nos presentan.\r\n\r\n\"Reproducibilidad: refiere a la habilidad para repetir trabajo y obtener resultados similares\" y a la ciencia no le gusta perder el tiempo. ',0,2,'','','es','',3,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'la-neurociencia-sera-open-o-no-sera',9,'2018-03-12 18:56:26','2018-03-19 13:15:55','LixXDpNDkANXa6IYoquNK-97sFXRGnxA8kp9kNYm2fA'),(220,'Conocer el futuro con Prophet','Prophet es una librería Open Source de Facebook (increíble pero cierto), para representar series temporales.','En febrero del año pasado, Facebook liberó al mundo su librería de forecasting, transformando la visualización de series temporales de un tedioso drama para plotters a una actividad placentera y sencilla. Con gráficas muy bonitas.\r\n\r\nVeremos qué se puede hacer con Prophet a través de ejemplos dinámicos, y me centraré en explicar cómo leer y entender los gráficos que produciremos, para que todos podamos recurrir confiadas y confiados a Prophet en el futuro si lo necesitamos. Escribiremos el código en Python (aunque hay más bien poco código), en una Jupyter Notebook para ser exactos.\r\n\r\nNo es necesario saber Python ni ninguna otra cosa. Aunque estaría bien que lo trajesemos todo instaladito de casa -->\r\n\r\nPara usuarios de Linux:\r\n\r\nINSTALAR PIP (lo vamos a utilizar para instalar Jupyter y Prophet): sudo apt-get install python3-pip\r\n\r\nINSTALAR JUPYTER:  pip3 install jupyter-notebook\r\n\r\nINSTALAR PROPHET: pip3 install fbprophet\r\n\r\n\r\n\r\n\r\n\r\nPara usuarios de Windows:\r\n\r\n*hugs*\r\n\r\n',1,1,'','','es','',3,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'conocer-el-futuro-con-prophet',9,'2018-03-12 19:27:29','2018-03-21 17:13:53','5yKM88Q1FPgMXjLXlV1fW5kfjYC1O2SwUH5llCy0E2s'),(221,'K8S Production ready? un poco de sensatez por favor','Breve explicación de para que y para que no puede usarse K8S en producción','Tras tener que pasar una plataforma, de una sola máquina a un cluster de Kubernetes, se pueden sacar varias lecciones aprendidas que hacen preguntarse si Kubernetes está listo para producción de forma generalista.\r\n\r\nSon muchas las bondades de una herramienta como Kubernetes, pero también puede causar grandes dolores de cabeza si se confía mucho en la automatización o no se conoce en profundidad la aplicación que se quiere usar sobre un sistema orquestado con Kubernetes.',0,2,'','','es','',2,1,'','',NULL,'Leganés','',NULL,NULL,1,1,0,0,'','k8s-production-ready-un-poco-de-sensatez-por-favor',9,'2018-03-12 21:34:18','2018-03-19 11:17:16','v547eSiAWsk51QiH7P49ow-JYCdJlxS0ciORYQ1Aevg'),(222,'Varnish cache, solución a los problemas de carga','Varnish cache es un software de cache muy potente capaz de soportar grandes cargas de trabajo','Taller orientado a dar a conocer el las capacidades del software Varnish cache y realizar algunas pruebas de carga, el objetivo es demostrar como con una configuración básica se puede tener un sistema de cache muy robusto y capaz de soportar grandes cargas de trabajo llegando a miles de usuarios simultáneos con unos recursos limitados.\r\n\r\nNo es necesario conocimiento previo de dicho software, aunque el puede ser útil tener conocimientos de sistemas cache.\r\n\r\nSerá necesario un portátil con Docker y docker-compose instalado para realizar el taller.',1,2,'','','es','',3,1,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'varnish-cache-solucion-a-los-problemas-de-carga',9,'2018-03-12 21:53:40','2018-03-19 11:17:18','SGopEgiHbR8zuC_C5-5sCJIpZPd3CcfbkjLR9fdt4o0'),(223,'Blender basics ','Introducción al programa Blender. ','¿Qué es Blender? ¿Qué se puede hacer con Blender? ¿Cómo puedo hacer algo de forma rápida y sencilla con Blender? ',1,2,'','','','',4,8,'','',NULL,'Leganés','7.1.J02','2018-04-10 19:00:00','2018-04-10 19:00:00',1,1,1,0,'','blender-basics',9,'2018-03-14 17:50:56','2018-04-06 09:49:12','adhj7a80doha7s8dhoa'),(224,'Python no es un tipo de serpiente. ','Aprende a usar Python. Pero un Python básico. ','Para aquellas personas que quieran aprender a programar en Python. O al menos entender algo cuando la gente a su alrededor habla de Python. ',1,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'python-no-es-un-tipo-de-serpiente',9,'2018-03-14 17:55:11','2018-03-19 09:58:29',NULL),(225,'Extendiendo Kubernetes','Cómo extender Kubernetes, problemas encontrados y soluciones propuestas.','Esta charla está pensada para explicar cómo se puede extender Kubernetes para tener piezas específicas que cumplan nuestros requisitos. Hablaremos de los problemas a los que hay que enfrentarse y los beneficios que se pueden obtener.\r\n\r\nAdemás, explicaremos un proyecto que hemos llevado a cabo, las diferentes iteraciones que hemos hecho para mejorarlo, y lo que hemos aprendido gracias a ello.\r\n\r\nPor último, comentaremos una librería que hemos creado para que cualquiera pueda construir su propio controlador de una forma rápida y sencilla.\r\n\r\n* Para poder entender bien la charla, al menos será necesario conocer qué es Kubernetes (https://kubernetes.io/).',0,3,'https://product.spotahome.com/','https://github.com/spotahome/redis-operator','es','Para poder entender bien la charla, al menos será necesario conocer qué es Kubernetes (https://kubernetes.io/).',3,7,'','',NULL,'Leganés','3.S08','2018-04-11 16:30:00','2018-04-11 18:30:00',1,1,0,1,'','extendiendo-kubernetes',9,'2018-03-15 14:17:38','2018-04-02 14:50:40','TZQVpOvzOlAt1oqvgyirduuewmsIqHDtV3xI_1C_LgE'),(226,'Camina libre con Open Street Map','Deja atrás la pérdida total de privacidad con Google Maps y pásate al Lado Luminoso','Pues poca cosa más, qué es, cómo se usa, y alguno ejemplos chulos :)\r\n\r\n[OSM](https://www.openstreetmap.org/#map=5/51.500/-0.100)',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'camina-libre-con-open-street-map',9,'2018-03-15 14:36:45','2018-03-15 14:36:45',NULL),(227,'Tu primer videojuego con Godot 3','Montaremos un pequeño juego con este motor de juego libre, recientemente actualizado a la versión 3','Si siempre has querido hacer un videojuego pero no te has atrevido a pegarte con OpenGL o no quieres gastar tu dinero, paciencia y libertad con Unity o Unreal, te presentamos la alternativa libre.',1,2,'https://godotengine.org/','','es','',4,8,'','',NULL,'Leganés','7.1.J02','2018-04-10 19:00:00','2018-04-10 20:30:00',1,1,0,1,'','tu-primer-videojuego-con-godot-3',9,'2018-03-15 23:15:15','2018-04-06 09:48:44','f4c6h23785fh26f785h263f789h'),(228,'Introducción a Python','Dar unos primeros pasos adquiriendo buenos hábitos (código pythonico, desarrollo orientado a test, etc.) y aprendiendo librerías','Python es el cuarto lenguaje de programación más usado en el mundo (Fuente: Tiobe, 2018). Siendo el lenguaje de script preferido entre la comunidad de programadores internacional.\r\n\r\nPython destaca como lenguaje de programación en áreas como la administración de sistemas, inteligencia artificial y la ciencia en general. También tiene una comunidad amplia en otras áreas como la programación web, videojuegos, ...\r\n\r\nHemos seleccionado un buen número de ejemplos python (https://github.com/davidam/python-examples), para demostrar las capacidades del lenguaje en las diferentes áreas de la computación. ',1,3,'','https://github.com/davidam/python-examples','es','',5,8,'','',NULL,'Leganés','7.1.J02','2018-04-09 19:00:00','2018-04-09 21:00:00',1,1,0,1,'','introduccion-a-python',9,'2018-03-16 18:11:24','2018-03-31 19:13:16','Rv3c0okz9QW1L5A9cgAfl9H-5pAmbmO6cQh4lu_pbJw'),(229,'El sonido del Open Source','Introducción a Pure Data','Una introducción práctica a Pure Data, un sistema modular visual de generación, síntesis y procesado de sonido compatible con Windows, macOS, Linux e incluso el GPIO de Raspberry Pi.',1,3,'http://puredata.info/','','es','',3,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'el-sonido-del-open-source',9,'2018-03-17 13:43:54','2018-03-21 17:13:57','DfrErqUEdev1FG3UGmiTlg1Mr8PQlSdsAdmzfRk2Og0'),(230,'Mi primer clúster con Kubernetes','Breve introdución a Kubernetes y demo con los primeros pasos','Montar aplicaciones orientadas a microservicios está a la orden del día pero... ¿cómo puedo montar algo así?\r\n\r\nUna de las plataformas más extendidas para el despliegue de este tipo de aplicacaciones es Kubernetes. En esta charla intentaré explicar brevemente qué es y cómo funciona este sistema, los diferentes conceptos clave y una demostración de uso montando un pequeño clúster.',0,2,'','','es','',3,3,NULL,NULL,NULL,'Leganés',NULL,NULL,NULL,1,1,0,0,NULL,'mi-primer-cluster-con-kubernetes',9,'2018-03-17 17:21:52','2018-03-22 12:04:08','I2kYSnE-RCpcE1vo7eF2QYDqMxpVYzRClFPlhc9SD7I'),(231,'La vida se ve de otro color... si la visualizas con R','Paseo práctico por las bases de la visualización de datos... usando el lenguaje correcto ;)','El disparado aumento de datasets disponibles y nuestra mejora en su procesado representa muy buenas noticias para ti, te dediques a lo que te dediques. Pero, también independientemente de lo que hagas, ahora debes afrontar la necesidad de aprender a utilizarlos.\r\n\r\nTener acceso a una gran cantidad de datos, en principio, no sirve de nada. Lo útil es aprender a extraer de ellos la información correcta.\r\nPor eso, en este taller aprenderemos a entender esos datos de la mejor forma posible: visualizándolos. Y además lo haremos de la mejor forma posible: utilizando un lenguaje Open Source creado precisamente para ello. \r\n\r\n¿Por qué deberías pasarte a R para trabajar con tus datos, si [TU NO-DATA-ORIENTED LENGUAJE FAVORITO] ya es casi tu lengua materna? ¡Ven y te lo explicamos!\r\n\r\n\r\nNo hay requerimientos para venir, pero para aprovechar el taller deberías tener acceso a un portátil con el que seguirnos. ',1,2,'','','es','',3,5,'','',NULL,'Leganés','7.1.J02','2018-04-10 17:00:00','2018-04-10 19:00:00',1,1,1,1,'','la-vida-se-ve-de-otro-color-si-la-visualizas-con-r',9,'2018-03-17 19:13:27','2018-04-09 21:26:55','F_dd_Hh_SZ6vr2CmKyQ3l8o4KG6xINyqeId2YZH4dmc'),(232,'Destripando la blockchain','Sesión de disección de la blockchain utilizada en Bitcoin.','En esta charla se explicará el funcionamiento de la blockchain en Bitcoin explicando todos los conceptos básicos para que cualquier estudiante, tanto informático como no informático, pueda entender el mecanismo de la tecnología blockchain.',0,2,'','','es','',4,12,'','',NULL,'Leganés','3.S08','2018-04-09 17:00:00','2018-04-09 19:00:00',1,1,0,1,'','destripando-la-blockchain',9,'2018-03-18 22:31:28','2018-03-31 19:12:51','mf4nM6avCMKNWIzmoRGTKjNxkSBNKACPVjzICgAHpLg'),(233,'Introducción a la creación de bots','Una introducción preparatoria a la creación de bots para el hackathón del día siguiente','Una introducción preparatoria a la creación de bots para el hackathón del día siguiente',0,2,'','','es','',4,0,'','',NULL,'Leganés','3.S08','2018-04-12 19:00:00','2018-04-12 21:00:00',1,1,0,1,'@fcerezal','introduccion-a-la-creacion-de-bots',9,'2018-04-01 14:16:32','2018-04-01 14:18:29','13wiudhwa7doh2hekdayd7u8i'),(234,'Hackathon','Una competición inclusiva de diseño y creación de bots','Es necesario inscribirse para participar. Puedes hacerlo en gg.gg/GULHack2018 (el link también está en la sección de material adicional). En este mismo formulario está indicado el horario del concurso.\r\n\r\nUno de los fines de la competición es motivar a más mujeres a participar en este tipo de eventos, por lo que vamos a intentar que el mismo sea lo más inclusivo posible. Con este fin, hemos establecido una norma: cada equipo deberá contar con una CAPITANA (Por tanto, no se aceptará la participación de ningún equipo en el que todos los miembros sean hombres).\r\n\r\nEl concurso está dividido en dos partes, que se evaluarán por separado, cada una de ellas con premios distintos. La primera consiste en diseñar un bot, pensando en cómo podrá solucionar el problema que os plantearemos y en todas sus características. La segunda fase consiste en la implementación del bot, aquí sí es necesario que sepáis programar para darle vida a vuestro diseño. No importa que no sepas programar, aunque sí estaría bien que supieras lo que es un bot. Para ello hay una charla de creación de bots el 12 de abril, el día anterior a este evento!',1,3,'https://gg.gg/GULHack2018','','es','',6,4,'','',NULL,'Leganés','7.1.J04 hasta las 15:00 - después la 7.1.J05','2018-04-13 09:30:00','2018-04-13 21:00:00',1,1,0,1,'','hackathon',9,'2018-04-01 14:28:12','2018-04-02 18:16:01',''),(235,'PCMaster... Oh wait','Aprende a montar tu ordenador de sobremesa desde cero','Montamos un ordenador de sobremesa en directo, aprendiendo sobre los componentes en el proceso.',1,1,'','','es','',4,7,'','',NULL,'Leganés','Por confirmar','2018-04-13 18:30:00','2018-04-13 20:00:00',1,1,0,1,'','pcmaster-oh-wait',9,'2018-04-06 17:59:00','2018-04-06 17:59:07','tymvq79lzesftg6u8i4c'),(236,'Install Party','Instala Linux y aprende cómo funciona el sistema operativo más usado del mundo','¿Has oído hablar de Linux pero nunca te has atrevido a probarlo?</br>\r\nVen y descubre las maravillas de esta familia de sistemas operativos.</br>\r\n</br>\r\n*Será necesario un portátil en el que instalarlo tanto como sistema principal como en una máquina virtual</br>\r\n</br>\r\n*Será necesario traer un usb con una iso de Ubuntu/Debian grabada</br>\r\nIso Ubuntu: https://www.ubuntu.com/download/desktop/thank-you?country=ES&version=18.10&architecture=amd64</br>\r\nIso Debian: https://www.debian.org/CD/</br>\r\n¿Cómo grabar una iso?: https://rufus.ie/',1,1,'','','es','',5,12,'','',NULL,'Av. de la Universidad, 30, 28911','1.0.F.01','2019-02-18 16:00:00','2019-02-18 18:00:00',1,1,0,1,'','install-party',10,'2019-01-28 13:38:10','2019-02-11 08:57:53','WumekutMGLRy7zbKqqC9cD5K2j5VHiv0sypLGTscSYQ'),(237,'Pulse aquí para optimizar su PC un 101%','Optimiza el consumo de energía y el rendimiento para un entorno de uso real de tu portátil con GNU/Linux.','¿Alguna vez te has planteado si es posible aumentar la duración de la batería de tu portátil en GNU/Linux? ¿No entiendes por qué en determinadas situaciones tu sistema ve mermado su rendimiento en tareas básicas? Este taller es la solución defiinitiva a todos tus problemas con la gestión de energía y el rendimiento en GNU/Linux.',1,1,'https://gitlab.com/Juanbanpar/optimize-linux-for-real-worl-usage','https://gitlab.com/Juanbanpar/optimize-linux-for-real-worl-usage','es','',4,10,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-19 11:00:00','2019-02-19 13:00:00',1,1,0,1,'','pulse-aqui-para-optimizar-su-pc-un-101',10,'2019-01-28 15:03:55','2019-03-10 12:45:58','VpiHopr0-VpUqqVfqRimux-uNnX0PwyZPrJkUQeMKkg'),(238,'Impresoras 3D','Saber imprimir en 3D','Me gustaría saber mas sobre como imprimir en 3D',1,0,'https://github.com/JorFru/Charlas/blob/master/JornadasT%C3%A9cnicasGUL/XXXIII/Impresoras3D%20Jornadas%20Tecnicas%20GUL.odp','','','',0,8,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-21 16:00:00','2019-02-21 18:00:00',1,1,0,1,'','impresoras-3d',10,'2019-01-28 15:48:18','2019-02-21 23:34:12',''),(240,'Automatizate! El poder de los scripts','Por que hacer cosas manualmente ya es casi cosa del pasado.','No sabes qué es bash? Crees que los scripts son viruses? Descubre las ventajas de que resuelvan hagan otros tus problemas!\r\n\r\nEsta charla puede contener trazas de:\r\n- bash\r\n- python\r\n- comandos de linux como grep o cat\r\n- awk\r\n- crontab\r\n- frutos secos',1,1,'','','es','',3,10,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-18 11:00:00','2019-02-18 13:00:00',1,1,0,1,'','automatizate-el-poder-de-los-scripts',10,'2019-01-28 17:55:10','2019-02-11 09:01:21','yyiqMQvD0b4h-oifNaD0EYukEOcMcstoxnRqphIUlCs'),(241,'Taller de seguridad en redes WIFI','Taller educativo para todo aquel que no tenga WiFi en su casa','........................................................................................................................................................................................................................................................................................................................................................................................................................................................................................................',1,0,'','','','',0,3,'','',NULL,'Av. de la Universidad, 30, 28911','',NULL,NULL,1,1,0,0,'','taller-de-seguridad-en-redes-wifi',10,'2019-01-29 14:22:27','2019-02-04 12:21:45',''),(242,'VHDL: Very Hard Description Language','Temido por muchos, domado por pocos. ¡Lo mejor del hardware y lo mejor del software!','VHDL es un lenguaje de descripción de hardware usado sobre todo en FPGAs y microcontroladores. A pesar de que a simple vista pueda parecer un lenguaje de programación más, el paradigma que propone su aplicación lo aleja mucho del desarrollo de software convencional. Con la concurrencia siempre presente, permite describir circuitos de manera funcional, estructural, o directamente como flujos de señales.',0,2,'','','es','Si el departamento de electrónica se presta, puedo llevar una placa de desarrollo para enseñar todo el proceso de diseño con VHDL, desde la idea hasta el circuito funcional.',5,3,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'vhdl-very-hard-description-language',10,'2019-01-29 19:05:43','2019-02-06 17:46:26','gE6DGEDcoWdX4eb3DV7b1q-mRG6bJGPOptzLfYMWbGQ'),(243,'Testing, motherf*cker, you speak it?','¿Quieres programar como los mejores?','Hay muchísimo miedo alrededor del testing. Por un lado no se aprende muy bien en la Universidad. Por otro, las empresas se organizan fatal y los tests incordian más que ayudan. La gente aprende que los tests son sinónimo de sufrimiento, y los evita a toda costa.\r\n\r\nSin embargo, aprender a hacer tests te convierte en mejor programador. Mejor código y bajo control. Nada de churros incomprensibles. Nada de hackers creídos. Nada de \"en mi máquina funciona, lo estarás haciendo mal\".\r\n',0,3,'','','es','',4,9,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-19 16:00:00','2019-02-19 18:00:00',1,1,0,1,'','testing-motherf-cker-you-speak-it',10,'2019-01-29 20:58:50','2019-02-11 09:01:04','nAUTi-qiTGgMiulQQD1ZU4glDGNvQ2W-CkOsP4lsbEI'),(244,'Cómo hacer un videojuego (SPOILER sale mal)','Postmortem de la experiencia de hacer un videojuego','Tanto si quieres hacer un videojuego, como saber como sería hacerlo, esta es tu charla donde se contará desde un punto de vista personal el proceso',0,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'como-hacer-un-videojuego-spoiler-sale-mal',10,'2019-01-29 21:20:21','2019-02-04 13:18:28',NULL),(245,'Los datos son pode R','Introducción al lenguaje R','Manejar datos es vital para muchas de las cosas que se hacen hoy en día. Dominar el arte análizarlos para conseguir información nos hace poderosos, y también sirve para satisfacer nuestra curiosidad sobre temas mundanos como la cantidad de minutos que llegarán tarde nuestros ~~malditos~~ queridos amigos a la quedada del viernes o cuales son las palabras más frecuentes en nuestros chats grupales.\r\n\r\nR es un lenguaje destinado al análisis estadístico y el manejo de datos, y en esta charla tendremos el placer de conocerlo y descubrir por que será un gran compañero a la hora de entrenar nuestras redes de neuronas o la frikada de inteligencia artificial que nos apetezca implementar.',0,2,'','','es','',4,3,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'los-datos-son-pode-r',10,'2019-01-31 15:48:54','2019-02-06 17:07:45','ayPuMga3SJkvQ2LEnqQn9G6n3U6U7uA_caJOYPkOXQc'),(246,'What is another word for a python? A mega-bite!','Aprende Python, el lenguaje de los dioses','En este taller aprenderás la sintaxis básica y tomarás tus primeros pasos junto a este maravilloso lenguaje.\r\n\r\nSerá necesario traer un portatil.\r\n\r\nTambién es recomendable traer una máquina con Linux...',1,2,'https://github.com/Patataman/PythonBasic/','','es','',5,9,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-21 11:00:00','2019-02-21 13:00:00',1,1,0,1,'','what-is-another-word-for-a-python-a-mega-bite',10,'2019-02-01 09:42:37','2019-02-11 09:00:30',''),(247,'Qué gaitas es un entorno de escritorio?','Charla informativa sobre entornos de escritorio','Lo primero que vemos de un OS es el escritorio. Y que nos guste o no juega un gran papel a la hora de quedarnos con dicho OS. Sin embargo, la mayoría de OS (los de verdad, no Windows) son compatibles con varios entornos de escritorio. Qué ventajas/inconvenientes tiene cambiar el entorno original?. Afecta sólo a como se ve el escritorio o tiene un efecto más profundo? Aprende a personalizar tu interfaz gráfica a fondo con esta interesantísima charla.',0,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'que-gaitas-es-un-entorno-de-escritorio',10,'2019-02-01 18:13:16','2019-02-06 17:46:24',NULL),(248,'Vim escape room','Aprender a utilizar el editor de texto Vim','# Vim escape room\r\n\r\nVim es un editor de texto desde terminal realmente potente, su aprendizaje es clave para mejorar tu eficiencia y tu productividad en entornos Linux. A través de un taller práctico, partiremos desde cero, hasta la utilización de algunos plugins que hacen de Vim un editor realmente completo.',1,3,'','','es','',3,9,'','',NULL,'Av. de la Universidad, 30, 28911','1.1.G.04','2019-02-20 11:00:00','2019-02-20 13:00:00',1,1,0,1,'','vim-escape-room',10,'2019-02-02 19:48:54','2019-02-11 09:00:18',''),(249,'Mi primer clúster con kubernetes','Introducción a kubernetes y demo con primeros pasos.','Montar aplicaciones orientadas a microservicios está a la orden del día pero... ¿cómo puedo montar algo así?\r\n\r\nUna de las plataformas más extendidas para el despliegue de este tipo de aplicacaciones es Kubernetes. En esta charla intentaré explicar brevemente qué es y cómo funciona este sistema, los diferentes conceptos clave y una demostración de uso montando un pequeño clúster.\r\n',0,2,'','','es','',3,6,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'mi-primer-cluster-con-kubernetes',10,'2019-02-03 17:55:41','2019-02-06 17:46:18','lMNyrmlpHnNYGzdSZXJml3o4dVoyrsLPYhvYBkzVBLI'),(250,'Cómo ser un Jedi Developer','Consejos que he aprendido desde que dejé la universidad','Hoy en día, con un poco de paciencia y tiempo libre, cualquier persona puede aprender (mejor o peor) a programar, pero, ¿qué es lo que realmente diferencia a un buen desarrollador del resto?\r\n\r\nEn esta charla daré mi opinión y compartiré consejos y cosas que he aprendido desde que dejé la universidad con un punto de vistá pragmático con el objetivo de que todos los asistentens puedan explotar todo su potencial y eviten el lado oscuro de la programación.\r\n\r\nEsta charla está pensada para ser una versión renovada de la que di en t3chfest 2016.',0,2,'','','es','',3,8,'','',NULL,'Av. de la Universidad, 30, 28911','1.0.F.01','2019-02-20 16:00:00','2019-02-20 18:00:00',1,1,0,1,'','como-ser-un-jedi-developer',10,'2019-02-03 18:05:38','2019-02-11 08:58:48','JLUhxS6CcPpNNvFhJnuXT-oL8FiWLKV8a_5OfXU3P9Q'),(251,'Trackers: \"cómo hacer música\" para hackers','¿Qué es un \"tracker\", de dónde surgen, y en qué se diferencian de otro software de creación musical?','Una breve introducción y vistazo rápido a los trackers musicales, el software original usado para crear música en el ordenador. Desde chiptune, demoscene y juegos de los 80 hasta el retorno de Renoise, la música electrónica y los cracks.',0,2,'','','es','',3,4,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-08 14:00:00','2019-10-08 15:00:00',1,1,0,1,'','trackers-como-hacer-musica-para-hackers',11,'2019-09-16 07:49:03','2019-10-01 11:30:54','RqQXYZ3cj7rnQV2WnGEr8FGDaoC5KhSrAFL_CpOhfTA'),(252,'Golang: por si no tenías suficiente Google en tu vida','Una brevísima introducción a Golang para ayudar a decidirte si merece la pena aprenderlo o crees que con C ya puedes hacer todo.','Go es un lenguaje chachi hecho por Google que lo tiene todo: es compilado, legible y paralelo. O no. En esta minicharla de introducción descubrirás si te gusta o no, y te prepararemos mentalmente para [el taller de Go práctico](https://cursos.gul.es/xxxiv-jornadas-tecnicas-del-gul/taller-de-golang-ponte-manos-a-la-obra-con-una-aplicacion-real) de estas mismas Jornadas Técnicas.',0,2,'','','es','',3,3,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-10 13:00:00','2019-10-10 14:00:00',1,1,0,1,'','golang-por-si-no-tenias-suficiente-google-en-tu-vida',11,'2019-09-16 11:46:08','2019-10-01 11:33:56','SSo0ki9xvR4F_NjxkZoMbjAeBwAxZqke8zG821cVX6U'),(253,'Introducción a las impresoras 3D','Historia de las impresoras, impresoras DIY y/o libres, trucos para empezar, enlaces de compra... jejejeje','¿Sabías que las impresoras 3D llevan existiendo desde los años 80 pero por culpa de una patente no eran accesibles para casi nadie?\r\nAl caducar esa patente la gente se puso manos a la obra y crearon diseños de impresoras 3D libres. Luego llegaron los chinos y bajaron los precios de las piezas para construirlas Y si tenemos impresoras 3D por 100€ es por aquellos diseños libres y la comunidad open source.',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'introduccion-a-las-impresoras-3d',11,'2019-09-16 12:03:36','2019-09-16 12:03:36',NULL),(254,'¿Cómo montar un estudio de radio?','GUL nos ha demostrado que hacer radio en un cuchitril es posible. ¿Podría enseñarnos sus trucos para aprender de su experiencia?','GUL nos ha demostrado que hacer radio en un cuchitril es posible. ¿Podría enseñarnos sus trucos para aprender de su experiencia?',1,0,'','','','',0,2,'','',NULL,'Av. de la Universidad, 30, 28911','',NULL,NULL,1,1,0,0,'','como-montar-un-estudio-de-radio',11,'2019-09-16 12:08:33','2019-09-25 16:38:12',''),(255,'Llegue a haber Linux','Cómo crear tu propio bootloader de Linux','GRUB es demasiado. Cualquiera que haya pasado por la experiencia de tener que configurarlo sabe que es algo que no desear ni a sus peores enemigos. Puede ser útil para  arrancar una distribución moderna en un PC moderno, pero cuando los recursos escasean, nos damos cuenta de que también escasean las alternativas. En este taller repasaremos algunas de estas alternativas a GRUB y empezaremos a crear un bootloader desde cero, sentando las bases de lo que, con tiempo y esfuerzo, podrá llegar a ser tu propia alternativa.',1,0,NULL,NULL,NULL,NULL,0,2,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'llegue-a-haber-linux',11,'2019-09-16 13:03:10','2019-09-26 07:19:21',NULL),(256,'Programación funcional','Charla/Taller introductoria a la programación funcional','Charla/Taller introductoria a la programación funcional',0,2,'','','es','',3,4,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-08 13:00:00','2019-10-08 14:00:00',1,1,0,1,'@voisier','programacion-funcional',11,'2019-09-17 07:14:38','2019-10-01 11:29:58',''),(257,'Mide tu proyecto de software libre','Un taller para desplegar GrimoireLab y visualizar lo que ocurre en tus proyectos de software libre favoritos','GrimoireLab es un conjunto integrado de herramientas libres para sacar y visualizar métricas acerca de la evolución de proyectos de desarrollo de software.\r\nSe conecta con el repositorio de código, las listas de correo, el bugtracker, wiki, los canales de chat, el sistema de integración contínua, etc y muestra gráficas como la evolución del tiempo medio desde que se abre un bug hasta que se cierra, de la cantidad de contribuyentes con frecuencia mensual o superior, de las empresas o grupos que más contribuyen, el ritmo de preguntas en el foro relacionadas con el rendimiento y en general cualquier duda cuya respuesta se pueda resolver o intuir mirando la información que guardan los sistemas de apoyo al desarrollo.\r\n\r\nLa idea es que alguien que sepa nos enseñe a ponernos en marcha y a resolver las dudas que nos corroan (o símplemente a cotillear qué pasa).',0,0,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'mide-tu-proyecto-de-software-libre',11,'2019-09-17 08:37:21','2019-09-17 08:37:21',NULL),(258,'VHDL: Very Hard Description Language','Mezcla hardware y software con un lenguaje de descripción de hardware maravilloso y nada pedante: VHDL','Hoy en día, la aceleración por hardware es una de las grandes quimeras del mundo de la la microcomputación.\r\n¿Para qué usar una ALU para algoritmos complejos cuando puedes meter un chip especializado que lo haga cien veces más rápido, sin ocupar la CPU?\r\nSi quieres ver cómo de fina es la línea entre ingeniería de software y electrónica, ven a aprender qué son los Hardware Description Languages.\r\n\r\n(Con demostración en directo si los dioses quieren)',0,1,'http://freerangefactory.org/pdf/df344hdh4h8kjfh3500ft2/free_range_vhdl.pdf','','es','',3,3,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-09 14:00:00','2019-10-09 15:00:00',1,1,0,1,'','vhdl-very-hard-description-language',11,'2019-09-17 09:45:21','2019-10-01 11:32:17','eEzd6MH3At-lw9IE7Gebf_UkI4yKZ3qNp4BHqKMvgj4'),(259,'Pulse aquí (de nuevo) para optimizar su Linux.','Charla para mejorar el rendiminto de GNU/Linux y reducir el consumo energético.','Segunda edición de esta charla sobre optimización del rendimiento y batería en GNU/Linux. El propósito de esta charla es el aprovachamiento máximo de los recursos de nuestro ordenador. Por defecto GNU/Linux hace una buena gestión pero no es perfecta para el caso de uso de un usuario promedio de escritorio.\r\n\r\nEn esta segunda edición se incluyen explicaciones más técnicas y ajustes más profundos.',0,2,'https://gitlab.com/Juanbanpar/optimize-linux-for-real-worl-usage','https://gitlab.com/Juanbanpar/optimize-linux-for-real-worl-usage','es','',4,3,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-07 14:00:00','2019-10-07 15:00:00',1,1,0,1,'','pulse-aqui-de-nuevo-para-optimizar-su-linux',11,'2019-09-18 08:39:05','2019-10-01 11:29:02','FPNxL5a26Yb51s0AiQDSkNHpg8KFerBv_3flXDsPtLw'),(260,'Taller de Golang: Ponte manos a la obra con una aplicación real','Continuación de la charla de Golang, asienta lo aprendido construyendo algo real','Continuación de la [charla introductoria a Golang](https://cursos.gul.es/xxxiv-jornadas-tecnicas-del-gul/golang-por-si-no-tenias-suficiente-google-en-tu-vida), utiliza lo aprendido poniendote manos a la obra en una aplicación real.\r\n<br /> <br />\r\nEn el desarrollo de la aplicación se cubrirá: <br />\r\n* Servidor HTTP: Crearemos una aplicación que escuche y responda a las peticiones HTTP. <br />\r\n* JSON: Haremos que nuestra aplicación responda JSONs. <br />\r\n* IO: Crearemos comunicación entre nuestra aplicación y una memoria persisitente. <br />\r\n* Interfaz de comandos: Programaremos una interfaz de comandos para comunicarnos con la aplicación. <br />\r\n* Tiempo: Programaremos algunas tareas en el tiempo. <br />\r\n* WebSocket: Crearemos una interfaz para comunicarnos con la aplicación vía web de manera mas intuitiva. <br />\r\n<br /> <br />\r\nSon muchas cosas, e intentaremos que de tiempo a cubrirlo todo, pero priorizaremos que lo que se haga se entienda.',1,3,'','https://github.com/quii/learn-go-with-tests','es','',3,4,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-10 14:00:00','2019-10-10 15:00:00',1,1,0,1,'','taller-de-golang-ponte-manos-a-la-obra-con-una-aplicacion-real',11,'2019-09-19 07:30:12','2019-10-01 11:33:26','hT046Prvx2jOJ00rp4TjWuoP5REDczKRViCAx6qtQaY'),(261,'Materiales + texturas estandar y procedurales en Blender 2.81 (cycles and eevee)','En la charla se trataran técnicas de sombreado a tiempo real y en raytrace estandar y procedurales','En la charla se trataran técnicas de sombreado a tiempo real y en raytrace estandar y procedurales, estas ultimas muy comunes en la industria del foto-realismo, animación y videojuegos muy actuales.\r\n\r\nLa composición de estas texturas se realizara mediante la técnica Shader Nodes ampliamente utilizada en casi todos los programas de computacion grafica, en este caso en la ultima version de software libre Blender 2.81.\r\n\r\nAdemas, de enfocarnos en estas texturas veremos un poco el entorno de trabajo de Blender enfocado a este apartado.',0,3,'','','es','Se necesitara en el aula un portatil con salida hdmi para el proyector y una tarjeta gráfica de gama media como nvidia gtx 780+ o amd para poder ver el renderizaje de forma mas rápida.',0,3,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-07 13:00:00','2019-10-07 14:00:00',1,1,0,1,'','materiales-texturas-estandar-y-procedurales-en-blender-2-81-cycles-and-eevee',11,'2019-09-19 17:39:26','2019-10-01 11:27:37','kXS7pnx1D64MnVj0cgFrA6cWoK4V9SY2pBApUdpx9rw'),(262,'CRAKEA la ROM y actualiza tu ANDROID','CRAKEA la ROM de tu móvil y actualiza tu ANDROID ( o, si lo prefieres, instálale FirefoxOS )','¿ Tu móvil va cada vez más lento?, ¿ y si pruebas a cambiarle la instalación que tiene de Android por defecto?. Podrías actualizar Android, e incluso, ponerle un Sistema Operativo más ligero ( cómo FirefoxOS, basado en HTML5 ) ',1,0,NULL,NULL,NULL,NULL,0,3,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'crakea-la-rom-y-actualiza-tu-android',11,'2019-09-19 18:45:21','2019-09-27 11:10:10',NULL),(263,'Distribuciones Unix marginales','Porque se puede sufrir aún más que instalando Arch','Lo bonito de Unix es que hay multitud de distribuciones, Debian, Ubuntu, Gentoo, RedHat, Arch, Fedora, CentOS, AntergOS, SUSE, Manjaro, SteamOS, Raspbian, etc, pero es también lo malo, multitud de entornos y muchos de su padre y de su madre.\r\n\r\nAquí veremos como instalarnos algunas distribuciones algo marginales, muy suyas y nada \"trendings\", por ejemplo [KISS](https://getkiss.org/),  [Suicide Linux](https://qntm.org/suicide) or [HML](http://hannahmontana.sourceforge.net/)',1,0,NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'Av. de la Universidad, 30, 28911',NULL,NULL,NULL,1,1,0,0,NULL,'distribuciones-unix-marginales',11,'2019-09-20 08:50:43','2019-09-23 07:30:59',NULL),(264,'El punto (micro) G existe, descubre una vida alejado del Big Data.','El uso diario de los smartphones los convierte perfectas máquinas de recopilar datos. Recupera tu privacidad con esta charla.','A falta de una alternativa libre accesible a todo el mundo, Android es el mal menor que las personas que valoran su privacidad. Pero por defecto es un sistema operativo que recopila datos masivamente.\r\nEn esta charla aprenderás a conseguir un Android más libre y privado sin sacificar (demasiada) funcionalidad.',0,3,'','','es','',3,8,'','',NULL,'Av. de la Universidad, 30, 28911','2.3.A03B','2019-10-09 13:00:00','2019-10-09 14:00:00',1,1,0,1,'','el-punto-micro-g-existe-descubre-una-vida-alejado-del-big-data',11,'2019-09-22 19:08:13','2019-10-01 11:31:30','UJXF_Yew-zAA5OU7hsoEwP2YbwfRlyMTQKsAM_EErNQ');
